INSERT INTO `changcheng_article2019` (`id`, `title`, `description`, `content`, `status`, `addtime`, `typeid`, `pic`) VALUES
(1, '公司简介', '中国长城资产管理股份有限公司（以下称“中国长城资产”）成立于2016年12月11日，注册资本512.3亿元，由中华人民共和国财政部、全国社会保障基金理事会和中国人寿保险（集团）公司共同发起设立。公司前身是国务院1999年批准设立的中国长城资产管理公司。', '<p><span style=\"color:#4C4C4C;font-family:&quot;background-color:#FFFFFF;font-size:16px;\"><span style=\"line-height:2.5;font-size:16px;\">&nbsp;&nbsp;&nbsp;&nbsp;<span style=\"line-height:2.5;\">中国长城资产管理股份有限公司（以下称“中国长城资产”）成立于2016年12月11日，注册资本512.3亿元，由中华人民共和国财政部、全国社会保障基金理事会和中国人寿保险（集团）公司共同发起设立。公司前身是国务院1999年批准设立的中国长城资产管理公司。</span></span></span><span style=\"color:#4C4C4C;font-family:&quot;background-color:#FFFFFF;font-size:16px;line-height:2.5;\">目前，中国长城资产服务网络遍及全国30个省、自治区、直辖市和香港特别行政区，设有31家分公司和1家业务部；旗下拥有长城华西银行、长城国瑞证券、长生人寿保险、长城新盛信托、长城金融租赁、长城投资基金、长城国际控股、长城融资担保、长城金桥咨询、长城国融投资、长城国富置业等10多家控股公司，致力于为客户提供包括不良资产经营、资产管理、银行、证券、保险、信托、租赁、投资等在内的“一站式、全方位”综合金融服务。</span></p><p><span style=\"color:#4C4C4C;font-family:&quot;background-color:#FFFFFF;font-size:16px;\">&nbsp;&nbsp;&nbsp;&nbsp;<span style=\"line-height:2.5;\">作为四家国有金融资产管理公司之一，中国长城资产成立之初的主要任务是收购、管理和处置国有银行剥离的不良资产。自成立以来，先后收购、管理和处置了中国农业银行、中国工商银行和其他商业银行等金融机构及非金融机构不良资产近2万亿元，积累了丰富的资产管理处置经验，打造了专业化的资产管理团队和经营运作技术。</span></span></p><p><span style=\"color:#4C4C4C;font-family:&quot;background-color:#FFFFFF;font-size:16px;\"><span style=\"line-height:2.5;\">&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"line-height:2.5;\">展望未来，中国长城资产将始终秉承“化解金融风险、提升资产价值、服务经济发展”的使命，坚持“突出主业、综合发展、体现特色”，以不良资产经营和第三方资产管理为核心构建“大资管”，以并购重组为核心构建“大投行”，实现全牌照综合金融服务的“大协同”，积极推进“大资管”、“大投行”、“大协同”三位一体的战略布局，致力于打造具有国际影响的“百年金融老店”。</span></span></p><p class=\"MsoNormal\" align=\"justify\" style=\"text-align:center;margin-top:10px;margin-bottom:0px;padding:0px;font-size:16px;color:#4C4C4C;text-indent:2em;font-family:&quot;background-color:#FFFFFF;\"><img src=\"/static/plug/kingeditor/attached/image/20190515/20190515140109_76615.png\" alt=\"\" /></p>', 1, 1559114679, 14, ''),
(2, '沈晓明董事长会见花旗集团机构客户部全球主席威尔米', '3月27日上午，中国长城资产管理股份有限公司董事长沈晓明在公司总部会见了花旗集团机构客户部全球主席阿尔伯特·威尔米（Alberto Verme）一行。', '<blockquote style=\"padding:0px;\"><p class=\"MsoNormal\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\">3月27日上午，中国长城资产管理股份有限公司董事长沈晓明在公司总部会见了花旗集团机构客户部全球主席阿尔伯特·威尔米（Alberto Verme）一行。</p><p class=\"MsoNormal\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\">这是继去年8月拜访之后，威尔米主席再次就双方有关合作事宜与沈晓明董事长进行沟通交流。</p><p class=\"MsoNormal\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\">双方有关部门及单位负责人参加了会见</p></blockquote><p class=\"MsoNormal\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\"><span style=\"font-family:&quot;font-size:12px;\"></span></p><blockquote><p><br /></p></blockquote><p><br /></p>', 1, 1557905249, 3, '/uploads/admin/20190515/9f6b3398a50812a6fe8831ee1aa8864f.png'),
(3, '什么是投资', '什么是投资', '&nbsp; &nbsp; &nbsp; &nbsp;投资，指国家或企业以及个人，为了特定目的，与对方签订协议，促进社会发展，实现互惠互利，输送资金的过程。又是特定经济主体为了在未来可预见的时期内获得收益或是资金增值，在一定时期内向一定领域投放足够数额的资金或实物的货币等价物的经济行为。可分为实物投资、资本投资和证券投资等。前者是以货币投入企业，通过生产经营活动取得一定利润，后者是以货币购买企业发行的股票和公司债券，间接参与企业的利润分配。', 1, 1557824693, 6, ''),
(4, '银行', '', '<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:14px;color:#808080;font-family:&quot;\">中国长城资产通过旗下的长城华西银行股份有限公司（简称“长城华西银行”）开展银行业务。长城华西银行的前身是德阳银行，成立于1998年，是一家规模初具、运行稳健的区域性股份制商业银行。2015年12月中国长城资产正式入主以来，长城华西银行秉承“一起成长，一起分享”的核心经营理念，专注“中小微企业伙伴银行”和“市民贴心银行”服务品牌打造，形成了“小额信贷工厂”、“女性友好银行”、“老年金融服务中心”，以及“会员制担保贷款”、“鼎诚卡”、“旌喜理财”、“小背篓”等具有自身鲜明特色的金融服务和金融产品品牌。目前，在成都、绵阳、眉山、泸州、巴中等地设立了分行，全行对外营业网点50余家，形成了“立足德阳、辐射全川、对接全国”的业务网络框架。</p><p style=\"margin-top:0px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:14px;color:#808080;font-family:&quot;\">目前提供的服务产品主要包括：流动资金贷款、固定资产贷款、经营性物业贷款、融资租赁保理、“e循贷”——流动资金循环贷款、“精英惠”——会员制担保贷款、应收账款质押贷款、专利权质押贷款和股权质押贷款等。</p>', 1, 1557991503, 10, ''),
(5, '人民日报 | 长城资产助力化解金融风险', '2019-02-19 人民日报电 （记者：许志峰）中国长城资产管理股份有限公司董事长沈晓明近日透露，2018年，长城资产全年实现1792亿元的金融不良资产收购规模。2019年，公司计划出资600亿元收购金融不良资产。 ', '<blockquote style=\"padding:0px;\"><p><span style=\"color:#4C4C4C;font-family:&quot;font-size:16px;background-color:#FFFFFF;\">人民日报电 （记者：许志峰）中国长城资产管理股份有限公司董事长沈晓明近日透露，2018年，长城资产全年实现1792亿元的金融不良资产收购规模。2019年，公司计划出资600亿元收购金融不良资产。&nbsp;</span></p><p><span style=\"color:#4C4C4C;font-family:&quot;font-size:16px;background-color:#FFFFFF;\">据介绍，长城资产积极发挥并购重组核心竞争力，做好防范化解金融风险工作。2018年，公司处置回收现金262.14亿元；实施4单市场化债转股业务。同时，公司围绕不良资产主业打造并购重组新模式，成功实施中国铁物市场化债转股项目，圆满处置化解首例央企私募债违约事件。（本文源自人民日报2019年2月18日第18版）</span></p></blockquote>', 1, 1557905380, 2, '/uploads/admin/20190515/c4150d426ad560a21915b264dbaa8221.png'),
(6, '打击和处置非法金融活动', '', '<p style=\"text-align:center;\"><img src=\"/static/plug/kingeditor/attached/image/20190515/20190515140814_97775.png\" alt=\"\" /></p><p><br /></p><p style=\"text-align:center;\"><span style=\"font-size:18px;\"><strong>防范领域</strong></span></p><blockquote></blockquote><blockquote></blockquote><blockquote><div><span style=\"font-size:16px;color:#333333;\">1.贷款领域。使用虚假抵质押物或超出抵质押物价值骗取贷款；使用虚假的批准立项文件、营业执照、财务报告、担保书、权属证明、债权凭证等证明文件骗取贷款；假借他人或单位名义骗取贷款的；使用虚假的经济合同骗取贷款。</span></div><div><span style=\"font-size:16px;color:#333333;\">2.票据领域。伪造、变造票据；故意使用伪造、变造的票据；签发空头支票或者故意签发与其预留的本名签名式样或者印鉴不符的支票；签发无可靠资金来源的汇票、本票；汇票、本票的出票人在出票时作虚假记载；冒用他人的票据，或者故意使用过期或者作废的票据；虚构贸易背景、伪造材料开票。</span></div><div><span style=\"font-size:16px;color:#333333;\">3.信用证领域。使用伪造、变造的信用证或者附随单据、文件；使用过期、已挂失等无效的信用证；虚构事实或者隐瞒真相骗取银行出具信用证。</span></div><div><span style=\"font-size:16px;color:#333333;\">4.信用卡领域。使用伪造、已作废的信用卡或以虚假身份证明骗领信用卡；盗刷信用卡；信用卡恶意套现；冒用他人的信用卡；恶意透支，经发卡银行催收后仍不归还透支款项。</span></div><div><span style=\"font-size:16px;color:#333333;\">5.保险金诈骗领域。故意虚构保险标的，故意制造保险事故或伪造保险事故骗取保险金的；伪造、变造与保险事故有关的证明、资料或其他证据，或指使、唆使、收买他人提供虚假证明、资料或其他证据，编造虚假的事故原因或夸大损失程度，骗取保险金的。特别是职业化、团伙化的保险欺诈犯罪，以及故意造成被保险人死亡、伤残、疾病等保险事故进行欺诈的恶性犯罪。</span></div><div><span style=\"font-size:16px;color:#333333;\">6.印制销售假冒保险公司保单、销售已作废保单，伪造或销售假保险单证的。</span></div><p><span style=\"font-size:16px;color:#333333;\">7.其他金融欺诈行为。</span></p></blockquote><blockquote></blockquote><blockquote></blockquote><blockquote></blockquote><blockquote></blockquote><blockquote></blockquote><blockquote></blockquote><blockquote></blockquote><blockquote></blockquote><blockquote></blockquote><blockquote></blockquote><p style=\"text-align:center;\"><span style=\"font-size:18px;\"><strong>群众防范要点</strong></span></p><blockquote><p><span style=\"font-size:16px;color:#333333;\">纵观各类网络金融骗局，诈骗分子日趋集团化、专业化，且手段不断翻新。作为网络金融用户，只要做到保管好“一卡、二码、三要素”，牢记“四要三不要”，就可有效防范金融诈骗。</span></p><p><span style=\"font-size:16px;color:#333333;\">【一卡】就是妥善保管好银行卡和网银盾等安全产品，不要借给他人使用。</span></p><p><span style=\"font-size:16px;color:#333333;\">【两码】是指电子银行密码及短信验证码。不要“一套密码走天下”，要将电子银行密码设置为数字+字母等复杂组合并定期修改。短信验证码是支付密码，绝不能以任何形式透露给他人。</span></p><p><span style=\"font-size:16px;color:#333333;\">【三要素】是身份证号、账号、手机号码等个人私密信息，切勿随意泄露。</span></p><p><span style=\"font-size:16px;color:#333333;\">【四要】一要认准官网网址。二要随时关注账户变动，开通账户变动短信、微信提醒服务。三要在办理电子银行转账、支付等交易时，仔细核对收款账户、商户、金额等信息是否正确。四要对手机电脑杀毒，使用电子银行交易的手机、电脑要安装专业杀毒软件，及时升级、定期查杀病毒。</span></p><p><span style=\"font-size:16px;color:#333333;\">【三不要】一不要使用公共网络。二不要点击不明链接和扫描二维码。三不要轻信电话、短信、QQ、微信中的所谓退款、贷款验资、司法协查、商品退款、积分兑换、中奖退税等信息。</span></p></blockquote><p><br /></p><p><br /></p>', 1, 1557901386, 12, ''),
(7, '扫黑除恶专题宣传', '', '<p style=\"text-align:center;\"><img src=\"/static/plug/kingeditor/attached/image/20190515/20190515142542_39450.png\" alt=\"\" /></p><blockquote style=\"padding:0px;\"><p><p class=\"MsoNormal\" style=\"text-indent:32.0000pt;\"><span style=\"font-size:16px;color:#333333;line-height:1.5;\">黑恶势力是经济社会健康发展的毒瘤，是人民群众深恶痛绝的顽疾，必须坚决依法予以打击。为深入贯彻落实党十九大精神，切实保障广大人民群众合法权益，维护社会和的谐稳定，按照中共中央、国务院《关于开展扫黑除恶专项斗争的通知》精神，决定在全国范围内开展为期三年的扫黑除恶专项斗争。</span></p></p><p><p class=\"MsoNormal\" style=\"text-indent:32.0000pt;\"><span style=\"font-size:16px;color:#333333;line-height:1.5;\">【扫黑除恶的意义】</span></p></p><p><p class=\"MsoNormal\" style=\"text-indent:32.0000pt;\"><span style=\"font-size:16px;color:#333333;line-height:1.5;\">在全国开展扫黑除恶专项斗争，是以习近平同志为核心的党中央作出的重大决策，事关社会大局稳定和国家长治久安，事关人心向背和基层政权巩固，事关进行伟大斗争、建设伟大工程、推进伟大事业、实现伟大梦想。要通过扫黑除恶专项斗争，不断增强人民获得感、幸福感、安全感，维护社会和谐稳定，巩固党的执政基础，为决胜全面建成小康社会、夺取新时代中国特色社会主义伟大胜利、实现中华民族伟大复兴的中国梦创造安全稳定的社会环境。</span></p></p><p><p class=\"MsoNormal\" style=\"text-indent:32.0000pt;\"><span style=\"font-size:16px;color:#333333;line-height:1.5;\">【扫黑除恶中的</span><span style=\"font-size:16px;color:#333333;line-height:1.5;\">“五要”】</span></p></p><p><p class=\"MsoNormal\" style=\"text-indent:32.0000pt;\"><span style=\"font-size:16px;color:#333333;line-height:1.5;\">要聚焦涉黑涉恶问题突出的重点地区、重点行业、重点领域，把打击锋芒始终对准群众反映最强烈、最深恶痛绝的各类黑恶势力违法犯罪。</span></p></p><p><p class=\"MsoNormal\" style=\"text-indent:32.0000pt;\"><span style=\"font-size:16px;color:#333333;line-height:1.5;\">要坚持依法严惩、打早打小、除恶务尽，始终保持对各类黑恶势力违法犯罪的严打高压态势。政法各机关要进一步明确政策法律界限，统一执法思想，加强协调配合，既坚持严厉打击各类黑恶势力违法犯罪，又坚持严格依法办案，确保办案质量和办案效率的统一，确保政治效果、法律效果和社会效果的统一。</span></p></p><p><p class=\"MsoNormal\" style=\"text-indent:32pt;\"><span style=\"font-size:16px;color:#333333;line-height:1.5;\">要严格贯彻宽严相济的刑事政策，对黑社会性质组织犯罪组织者、领导者、骨干成员及其</span><span style=\"font-size:16px;color:#333333;line-height:1.5;\">“保护伞”要依法从严惩 处，对犯罪情节较轻的其他参加人员要依法从轻、减轻处罚。</span></p></p><p><p class=\"MsoNormal\" style=\"text-indent:32pt;\"><span style=\"font-size:16px;color:#333333;line-height:1.5;\">要依法及时采取查封、扣押、冻结等措施，综合运用追缴、</span> <span style=\"font-size:16px;color:#333333;line-height:1.5;\">没收、判处财产刑以及行政罚款等多种手段，铲除黑恶势力经济基础。</span></p></p><p><p class=\"MsoNormal\" style=\"text-indent:32pt;\"><span style=\"font-size:16px;color:#333333;line-height:1.5;\">要主动适应以审判为中心的刑事诉讼制度改革，切实把</span> <span style=\"font-size:16px;color:#333333;line-height:1.5;\">好案件事实关、证据关、程序关和法律适用关，严禁刑讯逼</span> <span style=\"font-size:16px;color:#333333;line-height:1.5;\">供，防止冤假错案，确保把每一起案件都办成铁案。</span></p></p></blockquote><p><p class=\"MsoNormal\" style=\"text-align:center;text-indent:21pt;\"><img src=\"/static/plug/kingeditor/attached/image/20190515/20190515142633_11275.png\" alt=\"\" />&nbsp;</p></p><blockquote style=\"padding:0px;\"><p><p class=\"MsoNormal\" style=\"text-indent:32pt;\"><span style=\"font-size:16px;color:#333333;\">【重点打击的十一种恶势力违法行为】</span></p></p><p><p class=\"MsoNormal\" style=\"text-indent:32pt;\"><span style=\"font-size:16px;color:#333333;\">1. 把持基层政权、采取贿赂、暴力、欺骗、威胁等手段操纵破坏基层换届选举、垄断农村经济资源、侵吞集体资产的黑恶势力；</span></p></p><p><p class=\"MsoNormal\" style=\"text-indent:32pt;\"><span style=\"font-size:16px;color:#333333;\">2. 利用家族、宗族势力横行乡里、破坏治安秩序、称霸一方、欺压残害百姓的“村霸”“乡霸”等黑恶势力；</span></p></p><p><p class=\"MsoNormal\" style=\"text-indent:32pt;\"><span style=\"font-size:16px;color:#333333;\">3. 在征地、租地、拆迁、工程项目建设等过程中煽动闹事、组织阻拦工程、破坏投资环境、组织策划群体性上访的黑恶势力；</span></p></p><p><p class=\"MsoNormal\" style=\"text-indent:32pt;\"><span style=\"font-size:16px;color:#333333;\">4. 在建筑工程、交通运输、矿产资源等行业、领域，强揽工程、恶意竞标、非法占地、滥开滥采、收取“保护费” 的黑恶势力；</span></p></p><p><p class=\"MsoNormal\" style=\"text-indent:32pt;\"><span style=\"font-size:16px;color:#333333;\">5. 在商贸集市、批发市场、居民住宅小区、旅游景区等 场所欺行霸市、强买强卖、收保护费的市霸、行霸等黑恶势力；</span></p></p><p><p class=\"MsoNormal\" style=\"text-indent:32pt;\"><span style=\"font-size:16px;color:#333333;\">6. 操纵、经营“黄赌毒”等违法犯罪活动的黑恶势力；</span></p></p><p><p class=\"MsoNormal\" style=\"text-indent:32pt;\"><span style=\"font-size:16px;color:#333333;\">7. 各种“套路贷”“校园贷”等，涉嫌赌博放贷、非法</span></p></p><p><p class=\"MsoNormal\"><span style=\"font-size:16px;color:#333333;\">高利放贷、暴力讨债的黑恶势力；</span></p></p><p><p class=\"MsoNormal\" style=\"text-indent:32pt;\"><span style=\"font-size:16px;color:#333333;\">8. 采取“职业化”“组织化”方式，蓄意滋事，插手医 患、交通事故、安全事故、债务纠纷、邻里矛盾等，替人摆 平事端，充当“地下执法队”“地下出警队”的黑恶势力；</span></p></p><p><p class=\"MsoNormal\" style=\"text-indent:32pt;\"><span style=\"font-size:16px;color:#333333;\">9. 聚众斗殴、敲诈勒索、非法拘禁、寻衅滋事、强迫卖淫、组织卖淫、故意毁坏财物、开设赌场、强迫交易、强拿硬要、称王称霸等破坏一方秩序的黑恶势力；</span></p></p><p><p class=\"MsoNormal\" style=\"text-indent:32pt;\"><span style=\"font-size:16px;color:#333333;\">10. 组织或雇佣网络“水军”在网上威胁、恐吓、侮辱、 诽谤、滋扰的黑恶势力；</span></p></p><p><p class=\"MsoNormal\" style=\"text-indent:32pt;\"><span style=\"font-size:16px;color:#333333;\">11. 各类黑恶势力的“保护伞”。</span></p></p><p><span style=\"font-size:16px;color:#333333;\"></span></p></blockquote>', 1, 1557903822, 13, ''),
(8, '打击洗钱，遏制犯罪', '', '<p style=\"text-align:center;\"><img src=\"/static/plug/kingeditor/attached/image/20190515/20190515143405_95928.png\" alt=\"\" width=\"500\" height=\"663\" title=\"\" align=\"\" /></p><p style=\"text-align:center;\"><img src=\"/static/plug/kingeditor/attached/image/20190515/20190515143518_10836.png\" alt=\"\" width=\"500\" height=\"663\" title=\"\" align=\"\" /></p><p style=\"text-align:center;\"><img src=\"/static/plug/kingeditor/attached/image/20190515/20190515143540_13997.png\" alt=\"\" width=\"500\" height=\"663\" title=\"\" align=\"\" /></p><p style=\"text-align:center;\"><img src=\"/static/plug/kingeditor/attached/image/20190515/20190515143626_63491.png\" alt=\"\" width=\"500\" height=\"678\" title=\"\" align=\"\" /></p><p style=\"text-align:center;\"><img src=\"/static/plug/kingeditor/attached/image/20190515/20190515143644_99492.png\" alt=\"\" width=\"500\" height=\"678\" title=\"\" align=\"\" /></p><p style=\"text-align:center;\"><img src=\"/static/plug/kingeditor/attached/image/20190515/20190515143705_85671.png\" alt=\"\" width=\"500\" height=\"678\" title=\"\" align=\"\" /></p><p style=\"text-align:center;\"><img src=\"/static/plug/kingeditor/attached/image/20190515/20190515143746_82812.png\" alt=\"\" width=\"500\" height=\"678\" title=\"\" align=\"\" /></p>', 1, 1557902291, 12, ''),
(9, '2019年防范非法集资宣传月知识普及', '', '<p style=\"text-align:center;\"><img src=\"/static/plug/kingeditor/attached/image/20190515/20190515143931_12246.png\" alt=\"\" width=\"400\" height=\"548\" title=\"\" align=\"\" /></p><blockquote style=\"padding:0px;\"><p><br /></p><p class=\"MsoNormal\" style=\"text-indent:32.0000pt;\"><span style=\"font-size:16px;color:#333333;line-height:1.5;\">根据《最高人民法院关于审理非法集资刑事案件具体应用法律若干问题的解释》（法释〔</span><span style=\"font-size:16px;color:#333333;line-height:1.5;\">2010〕18号），非法集资是违反国家金融管理法律规定，向社会公众（包括单位和个人）吸收资金的行为。非法集资行为需同时具备非法性、公开性、利诱性、社会性四个特征要件：</span></p><p class=\"MsoNormal\" style=\"text-indent:32.0000pt;\"><span style=\"font-size:16px;color:#333333;line-height:1.5;\">非法性：未经有关部门依法批准或者借用合法经营的形式吸收资金；</span></p><p class=\"MsoNormal\" style=\"text-indent:32.0000pt;\"><span style=\"font-size:16px;color:#333333;line-height:1.5;\">公开性：通过媒体、推介会、传单、手机短信等途径向社会公开宣传；</span></p><p class=\"MsoNormal\" style=\"text-indent:32.0000pt;\"><span style=\"font-size:16px;color:#333333;line-height:1.5;\">利诱性：承诺在一定期限内以货币、实物、股权等方式还本付息或者给付回报；</span></p><p class=\"MsoNormal\" style=\"text-indent:32.0000pt;\"><span style=\"font-size:16px;color:#333333;line-height:1.5;\">社会性：向社会公众即社会不特定对象吸收资金。</span></p><p class=\"MsoNormal\" style=\"text-indent:32.1500pt;\"><b><i><span style=\"font-size:16px;color:#333333;line-height:1.5;\">非法集资的常见手段</span></i></b></p><p class=\"MsoNormal\" style=\"text-indent:32.0000pt;\"><span style=\"font-size:16px;color:#333333;line-height:1.5;\">一是承诺高额回报</span></p><p class=\"MsoNormal\" style=\"text-indent:32.0000pt;\"><span style=\"font-size:16px;color:#333333;line-height:1.5;\">不法分子编造</span><span style=\"font-size:16px;color:#333333;line-height:1.5;\">“天上掉馅饼”“一夜成富翁”的神话，许诺投资者高额回报。为了骗取更多的人参与集资，非法集资人在集资初期往往按时足额兑现承诺本息，待集资达到一定规模后，便秘密转移资金或携款潜逃，使集资参与人遭受经济损失。</span></p><p class=\"MsoNormal\" style=\"text-indent:32.0000pt;\"><span style=\"font-size:16px;color:#333333;line-height:1.5;\">二是编造虚假项目</span></p><p class=\"MsoNormal\" style=\"text-indent:32.0000pt;\"><span style=\"font-size:16px;color:#333333;line-height:1.5;\">不法分子大多通过注册合法的公司或企业，打着响应国家产业政策、开展创业创新等幌子，编造各种虚假项目，有的甚至组织免费旅游、考察等，骗取社会公众信任。</span></p><p class=\"MsoNormal\" style=\"text-indent:32.0000pt;\"><span style=\"font-size:16px;color:#333333;line-height:1.5;\">三是以虚假宣传造势</span></p><p class=\"MsoNormal\" style=\"text-indent:32.0000pt;\"><span style=\"font-size:16px;color:#333333;line-height:1.5;\">不法分子在宣传上往往一掷千金，聘请明星代言、名人站合，在各大广播电视、网络等媒体发布广告、在著名报刊上刊登专访文章、雇人广为散发宣传单、进行社会捐赠等方式，制造虚假声势。</span></p><p class=\"MsoNormal\" style=\"text-indent:32.0000pt;\"><span style=\"font-size:16px;color:#333333;line-height:1.5;\">四是利用亲情诱骗</span></p><p class=\"MsoNormal\" style=\"text-indent:32.0000pt;\"><span style=\"font-size:16px;color:#333333;line-height:1.5;\">有些类传销非法集资的参与人，为了完成或增加自己的业绩，不惜利用亲情、地缘关系，编造自己获得高额回报的谎言，拉拢亲朋、同学或邻居加入，使参与人员迅速蔓延，集资规模不断扩大。</span></p><p class=\"MsoNormal\" style=\"text-indent:32.1500pt;\"><b><i><span style=\"font-size:16px;color:#333333;line-height:1.5;\">典型非法集资活动的</span><span style=\"font-size:16px;color:#333333;line-height:1.5;\">“四部曲”</span></i></b></p><p class=\"MsoNormal\" style=\"text-indent:32.0000pt;\"><span style=\"font-size:16px;color:#333333;line-height:1.5;\">第一步：画饼</span></p><p class=\"MsoNormal\" style=\"text-indent:32.0000pt;\"><span style=\"font-size:16px;color:#333333;line-height:1.5;\">非法集资人会编织一个或多个尽可能</span><span style=\"font-size:16px;color:#333333;line-height:1.5;\">“高大上”的项目。以“新技术”、“新革命”、“新政策”、“区域链”、“虚拟货币”等为幌子，描绘一幅预期报酬丰厚的蓝图，把集资参与人的胃口“吊”起来，让其产生“不容错过”“机不可失”的错觉。非法集资人一般会把“饼”画大，尽可能吸引参与人眼球。</span></p><p class=\"MsoNormal\" style=\"text-indent:32.0000pt;\"><span style=\"font-size:16px;color:#333333;line-height:1.5;\">第二步：造势</span></p><p class=\"MsoNormal\" style=\"text-indent:32.0000pt;\"><span style=\"font-size:16px;color:#333333;line-height:1.5;\">利用一切资源把声势做大。非法集资人通常会举办各种造势活动，比如新闻发布会、产品推介会、现场观摩会、体验日活动、知识讲座等；组织集体旅游、考察等，赠送米面油、话费等小礼品；大量展示各种或真或假的</span><span style=\"font-size:16px;color:#333333;line-height:1.5;\">“技术认证”“获奖证书”“政府批文”；公布一些领导视察影视资料，公司领导与政府官员、明星合影；故意把活动选在政府会议中心、礼堂进行，其场面之大、规格之高极具欺骗性。</span></p><p class=\"MsoNormal\" style=\"text-indent:32.0000pt;\"><span style=\"font-size:16px;color:#333333;line-height:1.5;\">第三步：吸金</span></p><p class=\"MsoNormal\" style=\"text-indent:32.0000pt;\"><span style=\"font-size:16px;color:#333333;line-height:1.5;\">想方设法套取你口袋里的钱。非法集资人通过返点、分红，给参与人初尝</span><span style=\"font-size:16px;color:#333333;line-height:1.5;\">“甜头”，使其相信把钱放在他那儿不仅有可观的收入，而且比放在自己口袋里还安全，参与人不仅将自己的钱倾囊而出，还动员亲友加入，集资金额越滚越大。</span></p><p class=\"MsoNormal\" style=\"text-indent:32.0000pt;\"><span style=\"font-size:16px;color:#333333;line-height:1.5;\">第四部：跑路</span></p><p class=\"MsoNormal\" style=\"text-indent:32.0000pt;\"><span style=\"font-size:16px;color:#333333;line-height:1.5;\">非法集资人往往会在</span><span style=\"font-size:16px;color:#333333;line-height:1.5;\">“吸金”一段时间后跑路，或者因为原本就是“庞氏骗局”人去楼空，或者因为经营不善致使资金链断裂。集资参与人遭受惨重经济损失，甚至血本无归。</span></p><p><br /></p></blockquote>', 1, 1557902584, 12, ''),
(10, '中国长城资产成功发行150亿元金融债', '3月28日，中国长城资产管理股份有限公司（以下简称“中国长城资产”）在全国银行间债券市场成功发行150亿元金融债券。', '<blockquote style=\"padding:0px;\"><p style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\">3月28日，中国长城资产管理股份有限公司（以下简称“中国长城资产”）在全国银行间债券市场成功发行150亿元金融债券。其中，3年期品种100亿元，簿记票面利率3.65%；10年期品种50亿元，簿记票面利率4.59%。</p><p style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\">本期债券由主承销商组织承销团在银行间债券市场通过簿记建档、集中配售方式发行。中金公司为本期债券的牵头主承销商、簿记管理人，长城国瑞证券、中国工商银行、中国农业银行、中国银行、中国建设银行和交通银行为联席主承销商。</p><p style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\">经联合资信评估有限公司综合评定，发行人中国长城资产主体信用等级为AAA，本期债券的信用等级为AAA。</p><p style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\">本期债券是中国长城资产股改后首次在公开市场发行的普通金融债券，得到市场投资者的积极响应，3年期认购倍数2倍，10年期认购倍数2.5倍，反映出市场对中国长城资产品牌和公司稳健经营的认可。本次募集资金主要用于中国长城资产不良资产主业，公司将坚决贯彻落实审慎监管的各项要求，聚焦主业，依法合规经营，服务于国家供给侧结构性改革和防范化解金融风险的总体战略部署。</p></blockquote>', 1, 1557905236, 3, '/uploads/admin/20190515/443dc7b0445be66bb1bcfb0974bd5b44.png'),
(11, '沈晓明董事长会见日本生命保险社长清水博', '4月11日下午，中国长城资产管理股份有限公司董事长沈晓明在公司总部会见日本生命保险相互会社社长清水博一行，双方就有关业务合作事宜进行了深入交流。', '<p style=\"text-align:center;\"><img src=\"/static/plug/kingeditor/attached/image/20190515/20190515151121_93675.png\" alt=\"\" /></p><blockquote style=\"padding:0px;\"><p><p align=\"left\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;background-color:#FFFFFF;\">4月11日下午，中国长城资产管理股份有限公司董事长沈晓明在公司总部会见日本生命保险相互会社社长清水博一行，双方就有关业务合作事宜进行了深入交流。</p></p><p><p align=\"left\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;background-color:#FFFFFF;\">日本生命保险相互会社成立于1889年，是日本最大的人寿保险公司，也是日本最大的养老金发放管理机关。</p></p><p><p align=\"left\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;background-color:#FFFFFF;\">双方有关部门负责人参加了会见。</p></p></blockquote><p></p>', 1, 1557905227, 3, '/uploads/admin/20190515/6cc40595d3acace371c26146b09017fe.png'),
(12, '中国长城资产与北金所签署战略合作协议', '4月19日上午，中国长城资产管理股份有限公司（以下简称“中国长城资产”）与北京金融资产交易所有限公司（以下简称“北金所”）在京签署战略合作协议。', '<p style=\"text-align:center;\"><img src=\"/static/plug/kingeditor/attached/image/20190515/20190515151312_11553.png\" alt=\"\" /></p><blockquote style=\"padding:0px;\"><p><p align=\"left\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;background-color:#FFFFFF;\">4月19日上午，中国长城资产管理股份有限公司（以下简称“中国长城资产”）与北京金融资产交易所有限公司（以下简称“北金所”）在京签署战略合作协议。中国长城资产党委书记、董事长沈晓明与北金所董事长王乃祥出席签约仪式，中国长城资产总裁助理王彤和北金所总裁郭仌代表双方签署战略合作协议。北金所副总裁白双鹂、双方有关部门负责人陪同参加签约仪式。</p></p><p><p align=\"left\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;background-color:#FFFFFF;\">签约仪式前，沈晓明董事长和王乃祥董事长进行了深入友好会谈，双方互相介绍了公司发展现状与未来重点发展方向，并表示将以此次签约为契机，发挥各自专业领域优势，不断加强资产经营管理、市场化债转股、违约债券等方面业务合作，实现互利共赢。</p></p><p><p align=\"left\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;background-color:#FFFFFF;\">北金所于2010年5月30日正式揭牌运营，是经北京市人民政府批准成立的专业化金融资产交易机构，是中国人民银行批准的债券发行、交易平台，是中国人民银行批准的中国银行间市场交易商协会指定交易平台，是财政部指定的金融类国有资产交易平台，是积极稳妥降低企业杠杆率工作部际联席会议办公室授权的“市场化债转股信息报送平台”技术支持及运营维护机构，致力于为市场提供债券发行与交易、债权融资计划、委托债权投资、非上市企业股权、债权和抵债资产交易等服务。截至2019年一季度，北金所累计交易额已达22万亿元，服务各类市场参与人1.2万余家，遍及全国及世界多个重要经济体。</p></p></blockquote><p></p>', 1, 1557905220, 3, '/uploads/admin/20190515/60b3738dc1550e4f263fe5225ec7dccf.png'),
(13, '中国长城资产成功发行150亿元金融债', '2019年4月23日，中国长城资产管理股份有限公司（以下简称“中国长城资产”）在全国银行间债券市场成功发行第二期150亿元金融债券，其中3年期品种80亿元，簿记票面利率3.88%；10年期品种70亿元，簿记票面利率4.84%。', '<blockquote style=\"padding:0px;\"><p align=\"left\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;background-color:#FFFFFF;\">2019年4月23日，中国长城资产管理股份有限公司（以下简称“中国长城资产”）在全国银行间债券市场成功发行第二期150亿元金融债券，其中3年期品种80亿元，簿记票面利率3.88%；10年期品种70亿元，簿记票面利率4.84%。</p><p align=\"left\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;background-color:#FFFFFF;\">本期债券由主承销商组织承销团在银行间债券市场通过簿记建档、集中配售方式发行。中金公司为本期债券的牵头主承销商、簿记管理人，长城国瑞证券、中国工商银行、中国农业银行、中国银行、中国建设银行、交通银行为联席主承销商，另有中国人寿资产管理有限公司、太平资产管理有限公司、广发银行、北京农村商业银行及汇丰银行等10家承销团成员参与发行。</p><p align=\"left\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;background-color:#FFFFFF;\">经联合资信评估有限公司综合评定，发行人中国长城资产主体信用等级为AAA，本期债券的信用等级为AAA。</p><p align=\"left\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;background-color:#FFFFFF;\">本期债券是中国长城资产继2019年3月28日后发行的第二期金融债券，得到市场投资者的积极响应。本次募集资金主要用于公司不良资产主业。公司将坚决贯彻审慎监管的各项要求，聚焦主业，依法合规经营，服务于国家供给侧结构性改革和防范化解金融风险的总体战略部署。</p></blockquote>', 1, 1557905212, 3, '/uploads/admin/20190515/f8bb73d0501629e4fc4c383afbc1556b.png'),
(14, '公司牵头联合同业运作的中国中铁债转股项目成功过会', '5月5日，证监会并购重组委召开第20次会议，我司牵头联合同业运作的中国中铁市场化债转股（发行股份购买资产）重组方案获无条件通过。', '<blockquote style=\"padding:0px;\"><p><span style=\"font-size:16px;\">5月5日，证监会并购重组委召开第20次会议，我司牵头联合同业运作的中国中铁市场化债转股（发行股份购买资产）重组方案获无条件通过。中国中铁债转股方案通过先增资上市公司子公司再与上市公司换股的两步走方式进行，开创了央企市场化法治化债转股的新模式。</span></p><p><span style=\"font-size:16px;\">为贯彻落实中央关于深化供给侧结构性改革、结构性去杠杆以及积极支持实体经济的各项政策要求，中国长城资产积极参与中国中铁市场化法治化债转股项目，切实降低了企业杠杆率，优化了公司治理，提升了企业持续健康发展能力。</span></p><p><span style=\"font-size:16px;\">2018年6月我司作为项目主要牵头人之一与中国国新、中国东方、结构调整基金、穗达投资、中银资产、中国信达、工银投资和交银投资共计9家投资者通过收购债权转股权和现金增资的方式投资115.97亿元，持有中国中铁下属中铁二局、中铁三局、中铁五局和中铁八局等4家子公司部分股权。其中，我司收购了浙商银行北京分行对中铁二局、中铁三局、中铁八局合计25亿元债权，并转换为股权。</span></p><p><span style=\"font-size:16px;\">根据此次过会的中国中铁发行股份购买资产方案，中国中铁将以116.54亿元的总估值向9家债转股投资机构发行股份购买其持有的中国中铁4家子公司股权，届时我司所持中国中铁子公司股权将转换为中国中铁上市公司股权，我司预计持有上市公司股权365,691,328股，占总股数的1.49%。</span></p><p><span style=\"font-size:16px;\">中国中铁债转股具有以下三方面积极意义；一是有效降低了中国中铁的资产负债率。公开数据显示2018年末中国中铁合并口径资产负债率为76.43%，较上年同期下降3.46个百分点。二是优化了中国中铁的治理结构。此次交易引入投资人参与公司治理，9家债转股投资人委派的11名董事、监事参与到标的子公司的公司治理和重大经营决策。三是增强中国中铁核心竞争力和可持续发展能力。通过此次市场化法治化债转股有利于中国中铁充分发挥自身基建建设行业龙头的优势，优化资源配置，紧抓“一带一路”建设、京津冀协同发展、长江经济带发展和雄安新区建设等历史性机遇，聚焦主营业务发展，做大做强核心业务，提高中长期市场竞争力和盈利能力，为全体股东创造更多价值。</span></p><p><span style=\"font-size:16px;\">中国中铁债转股项目是公司继中国铁物债转股后又一央企债转股的成功案例，探索了深化供给侧结构性改革的新路径。该项目的成功实施，体现了资产公司在降低国企财务杠杆、盘活国有存量资产等方面的重要作用，彰显了中国长城资产作为中央金融企业的责任意识。</span></p></blockquote>', 1, 1557905206, 3, '/uploads/admin/20190515/8c603de5e75bba1a33e5474c39502675.png'),
(15, '沈晓明董事长会见美银美林固定收益、货币与商品部联席主管、董事总经理森古普塔', '5月7日，中国长城资产管理股份有限公司董事长沈晓明在公司总部会见美银美林固定收益、货币与商品部联席主管、董事总经理乔伊迪普·森古普塔(Joydeep Sengupta)一行，双方相互介绍了业务发展近况，并就不良资产业务合作、境内金融市场合作、境外发债、IPO等议题进行深入探讨。双方有关部门负责人参加了会见。', '<p style=\"text-align:center;\"><img src=\"/static/plug/kingeditor/attached/image/20190515/20190515151630_55045.png\" alt=\"\" /></p><blockquote><p><span style=\"font-size:16px;\">5月7日，中国长城资产管理股份有限公司董事长沈晓明在公司总部会见美银美林固定收益、货币与商品部联席主管、董事总经理乔伊迪普·森古普塔(Joydeep Sengupta)一行，双方相互介绍了业务发展近况，并就不良资产业务合作、境内金融市场合作、境外发债、IPO等议题进行深入探讨。双方有关部门负责人参加了会见。</span></p></blockquote>', 1, 1557905188, 3, '/uploads/admin/20190515/899fad86e0aa8b2bff9ff71c1085782c.png'),
(16, '沈晓明董事长会见阳光控股有限公司董事局主席林腾蛟', '5月10日下午，中国长城资产管理股份有限公司董事长沈晓明在公司总部会见了阳光控股有限公司董事局主席林腾蛟一行。双方有关部门及单位负责人参加了会见。', '<p style=\"text-align:center;\"><img src=\"/static/plug/kingeditor/attached/image/20190515/20190515151747_20132.png\" alt=\"\" /></p><blockquote style=\"padding:0px;\"><p style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\">5月10日下午，中国长城资产管理股份有限公司董事长沈晓明在公司总部会见了阳光控股有限公司董事局主席林腾蛟一行。双方有关部门及单位负责人参加了会见。</p><p align=\"left\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;background-color:#FFFFFF;\">阳光控股有限公司是“世界500强”企业，位列2018年《财富》榜单第464位，由爱国侨商林腾蛟先生于1995年创立，是一家集环保、教育、地产、金融、物产、资本六大产业集团为一体的大型投资控股公司。</p></blockquote>', 1, 1557905182, 3, '/uploads/admin/20190515/6e7208ab2c228bb4137c43795438badf.png'),
(17, '新华网 | 中国长城资产成功发行150亿元金融债', '2019-04-04  3月28日，中国长城资产管理股份有限公司（以下简称“中国长城资产”）在全国银行间债券市场成功发行150亿元金融债券。', '<blockquote style=\"padding:0px;\"><p style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\">3月28日，中国长城资产管理股份有限公司（以下简称“中国长城资产”）在全国银行间债券市场成功发行150亿元金融债券。其中，3年期品种100亿元，簿记票面利率3.65%；10年期品种50亿元，簿记票面利率4.59%。</p><p style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\">本期债券由主承销商组织承销团在银行间债券市场通过簿记建档、集中配售方式发行。中金公司为本期债券的牵头主承销商、簿记管理人，长城国瑞证券、中国工商银行、中国农业银行、中国银行、中国建设银行和交通银行为联席主承销商。经联合资信评估有限公司综合评定，发行人中国长城资产主体信用等级为AAA，本期债券的信用等级为AAA。</p><p style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\">本期债券是中国长城资产股改后首次在公开市场发行的普通金融债券，得到市场投资者的积极响应，3年期认购倍数2倍，10年期认购倍数2.5倍，反映出市场对中国长城资产品牌和公司稳健经营的认可。本次募集资金主要用于中国长城资产不良资产主业，公司将坚决贯彻落实审慎监管的各项要求，聚焦主业，依法合规经营，服务于国家供给侧结构性改革和防范化解金融风险的总体战略部署。</p></blockquote>', 1, 1557905449, 2, '/uploads/admin/20190515/afb93a5578d310cdd183406dc0d10750.png'),
(18, '金融时报 | 中国长城资产成功发行150亿元金融债', '2019-04-04 本报讯记者庞东梅报道3月28日，中国长城资产管理股份有限公司（以下简称“中国长城资产”）在全国银行间债券市场成功发行150亿元金融债券。', '<p style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\">本报讯记者庞东梅报道3月28日，中国长城资产管理股份有限公司（以下简称“中国长城资产”）在全国银行间债券市场成功发行150亿元金融债券。其中，3年期品种100亿元，簿记票面利率3.65%；10年期品种50亿元，簿记票面利率4.59%。</p><p style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\">本期债券由主承销商组织承销团在银行间债券市场通过簿记建档、集中配售方式发行。中金公司为本期债券的牵头主承销商、簿记管理人，长城国瑞证券、中国工商银行、中国农业银行、中国银行、中国建设银行和交通银行为联席主承销商。经联合资信评估有限公司综合评定，发行人中国长城资产主体信用等级为AAA，本期债券的信用等级为AAA。</p><p style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\">本期债券是中国长城资产股改后首次在公开市场发行的普通金融债券，得到市场投资者的积极响应，3年期认购倍数2倍，10年期认购倍数2.5倍，反映出市场对中国长城资产品牌和公司稳健经营的认可。本次募集资金主要用于中国长城资产不良资产主业。中国长城资产表示，将坚决贯彻落实审慎监管的各项要求，聚焦主业，依法合规经营，服务于国家供给侧结构性改革和防范化解金融风险的总体战略部署。</p>', 1, 1557909642, 2, '/uploads/admin/20190515/a6631f526cf66baef3794ef11a7af262.png'),
(19, '新浪财经 | 中国长城资产发行150亿元金融债 3年期票面利率3.65%', '2019-04-04 3月28日，中国长城资产管理股份有限公司在全国银行间债券市场成功发行150亿元金融债券。', '<p style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\">3月28日，中国长城资产管理股份有限公司在全国银行间债券市场成功发行150亿元金融债券。其中，3年期品种100亿元，簿记票面利率3.65%；10年期品种50亿元，簿记票面利率4.59%。</p><p style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\">本期债券由主承销商组织承销团在银行间债券市场通过簿记建档、集中配售方式发行。中金公司为本期债券的牵头主承销商、簿记管理人，长城国瑞证券、中国工商银行、中国农业银行、中国银行、中国建设银行和交通银行为联席主承销商。经联合资信评估有限公司综合评定，发行人中国长城资产主体信用等级为AAA，本期债券的信用等级为AAA。</p><p style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\">本期债券是中国长城资产股改后首次在公开市场发行的普通金融债券，得到市场投资者的积极响应，3年期认购倍数2倍，10年期认购倍数2.5倍，本次募集资金主要用于中国长城资产不良资产主业。</p>', 1, 1557909716, 2, '/uploads/admin/20190515/3e8c768107eead6f5cf9e9fc6cf73105.png'),
(20, '证券', '', '<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:14px;color:#808080;font-family:&quot;\">中国长城资产通过旗下的长城国瑞证券有限公司（简称“长城国瑞证券”）开展证券业务。长城国瑞证券（原“厦门证券”）成立于1988年，是经中国人民银行福建省分行批准，国内首批设立的证券公司之一。2014年11月，经财政部、中国银监会同意，并经中国证监会厦门监管局核准，中国长城资产管理公司成为长城国瑞证券的控股股东。公司注册资本为人民币33.5亿元。目前在北京、上海、深圳、广州、厦门等大中城市拥有36家证券营业部，经营范围包括证券经纪、证券投资咨询、与证券交易及证券投资活动有关的财务顾问、证券投资基金代销、代销金融产品、证券资产管理、证券自营、融资融券、证券承销与保荐等。</p><p style=\"margin-top:0px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:14px;color:#808080;font-family:&quot;\">中国长城资产入主后，长城国瑞证券各项业务的跨越式发展得到了行业的认可，并荣获2015、2017中国金融机构金融榜金龙奖“年度最具成长性证券公司”奖。未来，公司将秉承“大资管、大投行、大财富、大协同”的发展目标，致力于为中国实体经济和资本市场发展提供新功能，打造具有全方位资本中介服务能力的新形象。</p>', 1, 1557991515, 10, ''),
(21, '保险', '', '<span style=\"color:#808080;font-family:&quot;font-size:16px;background-color:#F6F6F6;\">&nbsp; &nbsp; &nbsp;中国长城资产通过旗下的长生人寿保险有限公司（简称“长生人寿保险”）开展保险业务。长生人寿保险成立于2003年9月，是中国首家获准开业的中日合资寿险公司。公司由中国长城资产、日本生命保险合资设立，2015年7月经中国保监会批准，公司注册资本金增至人民币21.67亿元。目前，公司已在长三角、北京及四川地区开展保险业务。随着业务的发展和营业区域的扩大，公司正加快向全国性经营的寿险公司迈进。</span>', 1, 1557991527, 10, ''),
(22, '信托', '', '<span style=\"color:#808080;font-family:&quot;font-size:14px;background-color:#F6F6F6;\">&nbsp; <span style=\"font-size:16px;\">&nbsp; 中国长城资产通过旗下的长城新盛信托有限责任公司（简称“长城新盛信托”）开展信托业务。中国长城资产信托业务根据客户资质条件与融资规模的不同，为客户设计灵活的信托产品交易结构和金融解决方案，帮助客户拓宽融资来源，降低融资成本，提升融资效率，全方位满足客户灵活多样的融资需求。目前可提供的业务服务有：贷款类信托、股权投资信托、特定资产收益权信托和证券投资信托等。</span></span>', 1, 1557991539, 10, ''),
(23, '金融租赁', '', '<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:14px;color:#808080;font-family:&quot;\">中国长城资产通过旗下的长城国兴金融租赁有限公司（简称“长城金融租赁”）开展金融租赁业务。长城金融租赁是经财政部和中国银监会批准成立的一家专业从事融资租赁业务的非银行金融机构，注册资本40亿元人民币。目前提供的服务产品包括：直接租赁业务、售后回租业务和经营性租赁业务等。自2008年重组以来，长城金融租赁立足新疆、辐射全国，不断创新产品模式，加大业务投放力度，在服务中小企业方面积累了独特优势，已先后为700多家客户提供多种金融租赁服务，总规模达500多亿元。</p><p style=\"margin-top:0px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:14px;color:#808080;font-family:&quot;\">&nbsp;</p><p style=\"margin-top:0px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:14px;color:#808080;font-family:&quot;\">近年来，在集团整体战略部署下，长城金融租赁加大对上市公司、国有企业、大中型民营企业等的拓展力度，已成为内蒙古亿利科技实业股份有限公司、东方希望集团有限公司、铁牛集团有限公司、山东魏桥创业集团有限公司、中国庆华能源集团等大型企业的合作伙伴。公司先后荣获银监会系统“学习型组织建设先进单位”，自治区级“文明机关”，“全国金融五一劳动奖状”等荣誉称号。</p>', 1, 1557991555, 10, ''),
(24, '私募基金', '', '<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:14px;color:#808080;font-family:&quot;\">中国长城资产通过旗下的长城（天津）股权投资基金管理有限责任公司（简称“长城投资基金”）开展基金业务。长城投资基金是一家专门从事私募投资基金管理业务的专业平台,运用自身广泛的融资渠道和灵活的融资方式，长城基金可根据企业客户的资质条件与融资规模，为客户设计并提供私募证券投资、私募股权投资、创业投资等金融服务。</p><p style=\"margin-top:0px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:14px;color:#808080;font-family:&quot;\">&nbsp;</p><p style=\"margin-top:0px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:14px;color:#808080;font-family:&quot;\">主要业务产品包括：并购基金、产业投资基金、证券投资基金、城镇化建设基金、不良资产整理基金、中小企业扶持基金、特殊机会投资基金和新三板企业股权投资基金等。</p><p style=\"margin-top:0px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:14px;color:#808080;font-family:&quot;\">&nbsp;</p><p style=\"margin-top:0px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:14px;color:#808080;font-family:&quot;\">目前，长城投资基金已先后发起设立了北京长富投资基金（有限合伙）、北京长华投资基金（有限合伙）、芜湖长元股权投资基金（有限合伙）、北京长城民星城镇化建设投资基金（有限合伙）、北京长城民盛中小企业股权投资基金（有限合伙）、江西长城兴赣中小企业投资管理合伙企业（有限合伙），芜湖长亨投资中心（有限合伙）和芜湖长利投资中心（有限合伙）等多支基金，基金管理总规模达到220亿元，居国内人民币私募基金行业前列。在具体的项目运作过程中，长城基金不但为客户有效解决了融资问题，还通过为客户提供财务顾问和管理咨询等服务，帮扶企业突破发展瓶颈，进一步提升经济效益。居国内人民币私募基金行业前列。</p>', 1, 1557991565, 10, ''),
(25, '金融咨询', '', '<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:14px;color:#808080;font-family:&quot;\">中国长城资产通过旗下的长城金桥金融咨询有限公司（简称“长城金桥咨询”）开展金融咨询业务。长城金桥咨询凭借专业的咨询团队和丰富的金融经验，通过对企业资产价值、业务经营、财务状况、盈利能力、现金流量等综合因素进行分析，可为客户提供量身定制的金融咨询服务。目前，已累计完成各类评估、评级、金融咨询项目10000余个，涉及行业40多个，咨询资产总额近40000亿元。</p><p style=\"margin-top:0px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:14px;color:#808080;font-family:&quot;\">&nbsp;</p><p style=\"margin-top:0px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:14px;color:#808080;font-family:&quot;\">主要的业务产品：金融债权估值、财务尽职调查、资产评估、企业价值评估、贷款项目评估、企业资信评级、投资项目咨询和并购重组咨询等。</p>', 1, 1557991577, 10, ''),
(26, '国际业务', '', '<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:14px;color:#808080;font-family:&quot;\">中国长城资产通过旗下的长城环亚国际投资有限公司（简称“长城环亚国际”）开展国际业务。长城环亚国际是中国长城资产在境外的全资子公司，1993年创立于香港，下设长城环亚国际资产管理有限公司、长城国际融资有限公司两家子公司，主要开展项目融资、并购融资、股权投资、资产管理、财务顾问等业务。</p><p style=\"margin-top:0px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:14px;color:#808080;font-family:&quot;\">近年来，长城环亚国际充分发挥集团品牌和境外资金成本优势，依托集团境内分支机构和业务网络，与国际知名金融机构和优秀中资企业建立了广泛的业务联系和密切合作，为多家大型企业和上市公司量身定制了跨境投融资方案，以香港资本市场为基础提供专业化、国际化投融资服务。</p><p style=\"margin-top:0px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:14px;color:#808080;font-family:&quot;\">作为中国长城资产旗下的国际化金融服务平台，长城国际将继续致力于充分发挥集团境内外协同联动的优势，为具有跨境金融需求的国内外客户提供全方位、一体化的金融服务和支持。</p><p style=\"margin-top:0px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:14px;color:#808080;font-family:&quot;\">近年来，长城环亚国际依托中国长城资产雄厚的实力背景和多元化的业务功能，在业内首创并推出了“跨境联动融资业务”等多项创新产品，该类产品通过多重法律关系的相互联动，创新实现了境内外机构共同控制项目风险。该类产品流程简洁、手续简便、易于操作，融资项目可涵盖金融、矿业、地产、科技、新能源、IT等多个行业。</p>', 1, 1557991590, 10, ''),
(27, '融资担保', '', '<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:14px;color:#808080;font-family:&quot;\">中国长城资产通过旗下的长城融资担保有限公司（简称“长城融资担保”）开展担保业务。长城融资担保是中国长城资产在深圳特区设立的全资子公司，成立于2009年3月，注册资本7.39亿元，在北京、上海、重庆、浙江设立了分支机构，是具有中央金融企业背景的全国性专业担保公司。</p><p style=\"margin-top:0px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:14px;color:#808080;font-family:&quot;\">主要的业务产品：贷款担保、发债担保、工程保函、诉讼保全保函、委托贷款、投资、融资咨询顾问等。自成立以来，长城融资担保已累计为近千家企业提供各类担保服务，在有效解决中小企业融资难问题的同时，成功帮助客户提高经营管理水平和经济效益，为社会经济发展作出了积极贡献。</p>', 1, 1557991600, 10, ''),
(28, '不良资产收购', '', '<span style=\"color:#808080;font-family:&quot;font-size:16px;background-color:#F6F6F6;\">&nbsp; &nbsp;<img src=\"/static/plug/kingeditor/attached/image/20190529/20190529113406_37552.png\" width=\"25\" height=\"25\" alt=\"\" /> 不良资产收购、管理和处置是中国长城资产的传统核心业务。中国长城资产根据市场原则购买各类金融机构和非金融机构的不良资产。中国长城资产自成立以来，先后收购、管理和处置了中国农业银行、中国工商银行、其他商业银行等金融机构及非金融机构不良资产1万多亿元。在此过程中，收购处置不良资产的区域广泛、行业众多、客户数量巨大，所有制结构多样，积累了处置不同类型不良资产的丰富经验，形成了收购处置批量不良资产的专业能力，培养了大量的不良资产收购处置专业队伍，建立了能批量处置不良资产的信息系统。</span>', 1, 1559109244, 5, ''),
(29, '不良资产经营', '', '<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:14px;color:#808080;font-family:&quot;\">中国长城资产对不良资产实施精细化经营处置，以专业的“价值发现、估值定价、价值提升和价值实现”能力为依托，通过资产置换、并购重组、债转股、追加投资、财务顾问、信用增级等多种金融服务手段，延伸资产经营价值链，最大限度地提升资产价值。</p><p style=\"margin-top:0px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:14px;color:#808080;font-family:&quot;\">主要业务产品：债权资产收购重组、债权资产收购+债转股+债务重组、债权资产收益权管理、债权资产收购+中小企业财务顾问、债权资产收购+反委托与合作处置、债权资产转股权、资产证券化等。</p>', 1, 1557991630, 5, ''),
(30, '问题企业求助', '', '<span style=\"color:#808080;font-family:&quot;font-size:16px;background-color:#F6F6F6;\">&nbsp; &nbsp; 在不良资产经营管理过程中，中国长城资产受国家有关部门、地方政府和债权人委托，对出现财务困难或经营危机的问题金融机构或问题企业提供托管救助服务，充分发挥不良资产收购功能和投资投行优势，综合运用“债务重组、资产重组、财务重组、企业重组、市场化债转股”等专业技术手段，帮助问题机构或企业摆脱困境、盘活资产、重焕生机。</span>', 1, 1557991641, 5, ''),
(31, '第三方资产管理', '', '<span style=\"color:#808080;font-family:&quot;font-size:16px;background-color:#F6F6F6;\">&nbsp; &nbsp; 中国长城资产在大力发展主业的基础上，不断延伸资产管理触角，以实现轻资本运营为目标，以拓展“大资管”业务为蓝图，依托母公司的资产配置优势、风控管控优势，以及子公司的综合金融服务手段，积极开展富有长城特色的第三方资产管理业务。</span>', 1, 1557991656, 5, ''),
(32, '中小企业特色服务', '', '<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:14px;color:#808080;font-family:&quot;\">中国长城资产以支持实体经济为己任，以重点服务中小企业为特色，重点选择符合国家产业政策，有成长潜力的中小企业客户，根据企业成长的不同阶段和金融服务需求，通过多种综合金融服务手段，为中小企业健康成长提供“一站式、全生命周期”的综合金融服务和个性化金融解决方案。</p><p style=\"margin-top:0px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:14px;color:#808080;font-family:&quot;\">主要业务产品：中小企业财务顾问及不良资产收购综合金融服务、小额贷款公司财务顾问及不良资产收购综合金融服务、中小企业集合票据远期收购承诺与资产管理、中小企业集合债券远期收购承诺与资产管理、中小企业私募债券远期收购承诺与资产管理。</p>', 1, 1557991665, 5, ''),
(33, '并购重组', '', '<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:14px;color:#808080;font-family:&quot;\">中国长城资产立足盘活经济存量、促进产业转型升级，以不良资产收购为依托，以上市公司为重点，以多种综合金融服务为手段，积极开展全产业链并购重组、问题公司借壳重组、股权再提升重组、新三板并购重组和企业定向增发等业务，充分依托集团公司协同运作网络，形成了一条龙式的并购重组服务链条，已累计为200多家上市公司开展了并购重组综合金融服务，打造了一系列经典案例。</p><p style=\"margin-top:0px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:14px;color:#808080;font-family:&quot;\">主要业务产品：债权收购+借壳上市、债权收购+债转股、定向增发+并购重组、产业投资+上市公司并购重组、破产重整+资产重组和不良资产并购重组等。</p>', 1, 1557991772, 9, ''),
(34, '股权投资', '', '<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:14px;color:#808080;font-family:&quot;\">中国长城资产依托自身强大的资金实力和丰富的投融资手段，通过阶段性股权投资、投资优先股、资产注入等方式，对符合国家产业政策、高成长性的企业客户给予资金支持，以持有类优先股或普通股的方式满足企业股权融资需求，助力企业快速成长，与企业实现共赢发展。</p><p style=\"margin-top:0px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:14px;color:#808080;font-family:&quot;\">主要业务产品：以并购重组为目的的股权投资（包括注入上市公司、借壳上市等）、阶段性股权投资和优质企业股权投资（PRE-IPO，新三板）等。</p>', 1, 1557991759, 9, ''),
(35, '固定收益', '', '<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:14px;color:#808080;font-family:&quot;\">中国长城资产根据企业客户意向融资规模、融资成本和融资期限等具体需求，综合运用自身在功能、资金、经验等方面的专业优势，通过资管计划、私募基金、可转债等方式为企业客户灵活设计交易结构，多渠道解决客户发展资金不足的问题。</p><p style=\"margin-top:0px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:14px;color:#808080;font-family:&quot;\">主要的业务产品包括：通过SPV（特殊目的实体）进行固定收益类债权投资、固定收益附加股权可选择权等。</p>', 1, 1557991752, 9, ''),
(36, '财务顾问', '', '<span style=\"color:#808080;font-family:&quot;font-size:16px;background-color:#F6F6F6;\">&nbsp; &nbsp; 中国长城资产运用自身在金融业务和企业经营管理方面的专业化知识与丰富经验，以及广泛的投融资渠道和多样化的金融业务平台，可为客户提供包括并购重组、产业投资、股权融资、产权交易、投融资计划、企业财务管理、经营战略规划、行业整合、股权激励等一系列专业顾问服务。目前已累计为500余家客户提供了投资顾问类服务，客户覆盖冶金、农业、采矿、制造、旅游、公共服务、建筑、房地产、物流、住宿、物业管理等多个行业。</span>', 1, 1557991740, 9, ''),
(37, '联系方式', '', '<p>地 址:&nbsp;<span style=\"color:#353535;font-family:-apple-system-font, BlinkMacSystemFont, &quot;font-size:14px;background-color:#FFFFFF;\">陕西省西安市高新区博文路51A号唐南大厦</span></p><p style=\"padding:0px;color:#333333;font-family:&quot;background-color:#FFFFFF;font-size:16px;margin-top:0px;margin-bottom:0px;\">邮 编:&nbsp;<span id=\"CPHMain_lblPostCode\">710000</span></p><p style=\"padding:0px;color:#333333;font-family:&quot;background-color:#FFFFFF;font-size:16px;margin-top:0px;margin-bottom:0px;\">电 话:&nbsp;<span id=\"CPHMain_lblTele\"><a href=\"tel:029-62220220\">029-62220220</a></span></p>', 1, 1560822286, 16, ''),
(38, '公司简介', '中国长城资产管理股份有限公司（以下称“中国长城资产”）成立于2016年12月11日，注册资本512.3亿元，由中华人民共和国财政部、全国社会保障基金理事会和中国人寿保险（集团）公司共同发起设立。', '<blockquote><p><span style=\"font-size:16px;\">&nbsp; &nbsp; 中国长城资产管理股份有限公司（以下称“中国长城资产”）成立于2016年12月11日，注册资本512.3亿元，由中华人民共和国财政部、全国社会保障基金理事会和中国人寿保险（集团）公司共同发起设立。公司前身是国务院1999年批准设立的中国长城资产管理公司。</span></p><p><span style=\"font-size:16px;\">&nbsp; &nbsp; 目前，中国长城资产服务网络遍及全国30个省、自治区、直辖市和香港特别行政区，设有31家分公司和1家业务部；旗下拥有长城华西银行、长城国瑞证券、长生人寿保险、长城新盛信托、长城金融租赁、长城投资基金、长城国际控股、长城融资担保、长城金桥咨询、长城国融投资、长城国富置业等10多家控股公司，致力于为客户提供包括不良资产经营、资产管理、银行、证券、保险、信托、租赁、投资等在内的“一站式、全方位”综合金融服务。</span></p><p><span style=\"font-size:16px;\">&nbsp; &nbsp; 作为四家国有金融资产管理公司之一，中国长城资产成立之初的主要任务是收购、管理和处置国有银行剥离的不良资产。自成立以来，先后收购、管理和处置了中国农业银行、中国工商银行和其他商业银行等金融机构及非金融机构不良资产近2万亿元，积累了丰富的资产管理处置经验，打造了专业化的资产管理团队和经营运作技术。</span></p><p><span style=\"font-size:16px;\">&nbsp; &nbsp; 展望未来，中国长城资产将始终秉承“化解金融风险、提升资产价值、服务经济发展”的使命，坚持“突出主业、综合发展、体现特色”，以不良资产经营和第三方资产管理为核心构建“大资管”，以并购重组为核心构建“大投行”，实现全牌照综合金融服务的“大协同”，积极推进“大资管”、“大投行”、“大协同”三位一体的战略布局，致力于打造具有国际影响的“百年金融老店”。</span></p></blockquote>', 1, 1557992003, 15, ''),
(39, '董事长致辞', '', '<blockquote style=\"padding:0px;\"><p class=\"MsoNormal p_left\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;font-size:16px;color:#4C4C4C;text-indent:5em;text-align:justify;font-family:&quot;background-color:#FFFFFF;\">经国务院批准，2016年12月11日，中国长城资产管理股份有限公司在京挂牌成立，从此迈入构建现代企业制度、全面开展商业化经营、提升内涵价值和核心竞争力的全新历史发展阶段，这是在党中央、国务院领导下，中国国有金融机构深化改革的最新成果。</p><p class=\"MsoNormal\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;font-size:16px;color:#4C4C4C;text-indent:2em;text-align:justify;font-family:&quot;background-color:#FFFFFF;\">中国长城资产成立于1999年10月，是经国务院批准成立的四家金融资产管理公司之一。20年来，中国长城资产始终坚持规范经营，努力发挥资产收持、管理、处置和并购重组等业务功能，推动经济资源优化配置，帮助问题企业脱困，着力维护国家和地方金融稳定，累计收购处置金融机构和实体企业不良资产本息近2万亿元，有效履行了国家赋予的“化解金融风险、提升资产价值、服务经济发展”使命。</p><p class=\"MsoNormal\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;font-size:16px;color:#4C4C4C;text-indent:2em;text-align:justify;font-family:&quot;background-color:#FFFFFF;\">同时，中国长城资产自身也保持了稳步快速发展，现已成为一家实力雄厚，功能齐全，机构遍布全国，业务涵盖银行、证券、保险、信托和金融租赁等全牌照的金融控股集团。</p><p class=\"MsoNormal\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;font-size:16px;color:#4C4C4C;text-indent:2em;text-align:justify;font-family:&quot;background-color:#FFFFFF;\">2019年，中国长城资产将牢牢抓住经济转型升级和国有企业改革发展的契机，加快发展不良资产主业，逐步形成以不良资产业务为核心，以并购重组和全牌照综合金融服务为特色的竞争优势。同时，稳步构建科学合理的公司治理结构，持续增强资本实力，优化体制机制，提高运营和管理效率。</p><p class=\"MsoNormal\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;font-size:16px;color:#4C4C4C;text-indent:2em;text-align:justify;font-family:&quot;background-color:#FFFFFF;\">“新故相推，日生不滞”。在过去的19年，中国长城资产圆满地完成了国家赋予的处置任务，逐步构建起全牌照的综合金融服务格局。放眼未来，我们将坚持“稳健而不保守、进取而不冒进”的经营理念，进一步强化市场意识、效率意识、创新意识和风险意识，以多元化客户需求为中心，不断提高自身的价值发现、价值提升和价值创造能力，从而将中国长城资产建设成为治理结构完善、管理现代化、服务功能齐全、业务模式可持续、特色突出、品牌响亮的金融控股集团，为客户提供高品质、全方位的综合金融服务，为股东创造具备市场竞争力的长期投资回报，为员工开辟更加广阔的发展空间。</p></blockquote>', 1, 1557998842, 15, ''),
(40, '宣传视频', '', '<div style=\"text-align:left;\"><br /></div>', 1, 1558332856, 15, ''),
(41, '公司地址', '', '<iframe src=\"https://cczc.snrunning.com/static/plug/kingeditor/plugins/baidumap/index.html?center=108.913726%2C34.233269&zoom=18&width=558&height=360&markers=108.913726%2C34.233269&markerStyles=l%2CA\" frameborder=\"0\" style=\"width:560px;height:362px;\"></iframe>', 1, 1558060537, 17, ''),
(44, '沈晓明董事长会见欧绿保集团董事长史伟浩', '5月23日上午，中国长城资产管理股份有限公司董事长沈晓明在公司总部会见欧绿保集团董事长史伟浩（Dr.Axel Schweitzer）一行。', '<p class=\"MsoNormal\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\">5月23日上午，中国长城资产管理股份有限公司董事长沈晓明在公司总部会见欧绿保集团董事长史伟浩（Dr.Axel Schweitzer）一行，双方就有关业务合作事宜进行了交流。</p><p class=\"MsoNormal\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\">双方有关部门及单位负责人参加了会见。</p>', 1, 1561447063, 3, '/uploads/admin/20190625/b6a7dd21334dfc5014d5102e4c9b361a.png'),
(45, '中国长城资产与杭州市人民政府签署战略合作协议', '5月30日下午，中国长城资产管理股份有限公司与杭州市人民政府签署《战略合作协议》，中国长城资产副总裁胡小钢、杭州市副市长姚峰代表双方签约。', '<p align=\"left\" style=\"text-align:center;margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;background-color:#FFFFFF;\"><img src=\"/static/plug/kingeditor/attached/image/20190625/20190625153343_13622.png\" alt=\"\" /></p><p align=\"left\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;background-color:#FFFFFF;\">5月30日下午，中国长城资产管理股份有限公司与杭州市人民政府签署《战略合作协议》，中国长城资产副总裁胡小钢、杭州市副市长姚峰代表双方签约。</p><p align=\"left\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;background-color:#FFFFFF;\">此次签约仪式在杭州市金融工作会议暨打造杭州国际金融科技中心推进大会上举行。签约前，浙江省委常委、杭州市委书记周江勇，杭州市委副书记、市长徐立毅等相关市领导与中国长城资产等签约机构进行会谈。</p><p align=\"left\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;background-color:#FFFFFF;\">根据《战略合作协议》，中国长城资产将在资产管理、金融租赁、信托业务、财务咨询、供应链金融、金融产品创新、产业投资等方面与杭州市政府开展全方位合作，促进杭州深入推进“金科产”融合发展，加快打造国际金融科技中心，实现经济与金融良性循环、健康发展。</p><p align=\"left\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;background-color:#FFFFFF;\">中国长城资产浙江分公司负责人及相关人员、杭州市政府有关部门负责人出席了签约仪式。</p>', 1, 1561448246, 3, '/uploads/admin/20190625/eedcce94236d060e3e50d5f97524a605.png'),
(46, '周礼耀总裁会见晋江市委副书记、市长张文贤', '6月19日上午，中国长城资产管理股份有限公司总裁周礼耀在公司总部会见晋江市委副书记、市长张文贤。', '<p style=\"text-align:center;\"><span style=\"color:#4C4C4C;font-family:&quot;font-size:16px;background-color:#FFFFFF;\"><img src=\"/static/plug/kingeditor/attached/image/20190625/20190625154018_64533.png\" alt=\"\" /><br /></span></p><p><span style=\"color:#4C4C4C;font-family:&quot;font-size:16px;background-color:#FFFFFF;\">&nbsp;&nbsp;&nbsp;&nbsp;6月19日上午，中国长城资产管理股份有限公司总裁周礼耀在公司总部会见晋江市委副书记、市长张文贤，双方就支持地方经济发展、防范化解区域风险等话题进行了交流。</span></p>', 1, 1561448431, 3, '/uploads/admin/20190625/8a212e0ed6342bf15e04682a403ac772.png'),
(47, '周礼耀总裁会见国新国际总经理周育先', '6月19日上午，中国长城资产管理股份有限公司总裁周礼耀在公司总部会见中国国新控股有限责任公司党委副书记、副董事长兼国新国际投资有限公司（简称国新国际）董事、总经理周育先一行，双方就有关业务合作事宜进行了交流。', '<p style=\"text-align:center;\"><img src=\"/static/plug/kingeditor/attached/image/20190625/20190625154246_12692.png\" alt=\"\" /></p><p style=\"text-align:justify;\"><p align=\"left\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;background-color:#FFFFFF;\">6月19日上午，中国长城资产管理股份有限公司总裁周礼耀在公司总部会见中国国新控股有限责任公司党委副书记、副董事长兼国新国际投资有限公司（简称国新国际）董事、总经理周育先一行，双方就有关业务合作事宜进行了交流。双方有关部门负责人参加了会见。</p><p align=\"left\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;background-color:#FFFFFF;\">国新国际于2012年5月在香港注册，首期资本金111.11亿美元，由中国国家外汇储备和国务院国资委共同出资设立，主要职责是支持中国企业国际化经营，实现国有资本保值增值。</p></p>', 1, 1561448605, 3, '/uploads/admin/20190625/c1efe4d02b8f9cf06c83975294514be3.png'),
(48, '中国长城资产召开“不忘初心、牢记使命”主题教育动员大会', '6月20日上午，中国长城资产召开公司系统“不忘初心、牢记使命”主题教育动员大会，深入学习贯彻习近平总书记重要讲话精神和银保监会党委部署，对公司系统开展主题教育进行动员部署。', '<p style=\"text-align:center;\"><img src=\"/static/plug/kingeditor/attached/image/20190625/20190625154625_21085.jpg\" alt=\"\" /></p><p style=\"text-align:justify;\">&nbsp;&nbsp;&nbsp;&nbsp;<span style=\"color:#4C4C4C;font-family:&quot;font-size:16px;background-color:#FFFFFF;\">6月20日上午，中国长城资产召开公司系统“不忘初心、牢记使命”主题教育动员大会，深入学习贯彻习近平总书记重要讲话精神和银保监会党委部署，对公司系统开展主题教育进行动员部署。公司党委书记、董事长沈晓明同志作动员讲话。中国银保监会第11巡回指导组组长周家龙同志出席会议并作指导讲话。公司党委副书记、总裁周礼耀同志主持会议。党委副书记、监事长胡永康，党委委员、副总裁孟晓东、胡小钢、邹立文，党委委员、纪委书记杜胜，总裁助理桑自国、王彤出席会议。</span><br /><span style=\"color:#4C4C4C;font-family:&quot;font-size:16px;background-color:#FFFFFF;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 沈晓明同志指出，本次主题教育是党中央统揽伟大斗争、伟大工程、伟大事业、伟大梦想做出的重大部署，是用习近平新时代中国特色社会主义思想武装全党的迫切需要，是推进新时代党的建设的迫切需要，是保持党同人民群众血肉联系的迫切需要，是实现党的十九大确定的目标任务的迫切需要。公司上下要结合自身实际，深刻认识这次主题教育的重大意义。</span><br /><span style=\"color:#4C4C4C;font-family:&quot;font-size:16px;background-color:#FFFFFF;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 沈书记要求，公司系统要按照银保监会党委要求，深入贯彻落实习近平总书记重要指示批示精神和党中央决策部署，把深学细悟习近平新时代中国特色社会主义思想作为重中之重，掌握核心要义和实践要求，立足“守初心、担使命，找差距、抓落实”的总要求扎实开展主题教育，达到“理论学习有收获、思想政治受洗礼、干事创业敢担当、为民服务解难题、清正廉洁作表率”的具体目标，确保主题教育取得实实在在的成效。并要对照公司业务经营攻坚的实际情况，把主题教育与长城公司的功能使命、工作任务和系统特点紧密结合，切实有效地解决公司的实际问题，确保公司系统主题教育与业务经营“两手抓、两促进”。</span><br /><span style=\"color:#4C4C4C;font-family:&quot;font-size:16px;background-color:#FFFFFF;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 中国银保监会第11巡回指导组组长周家龙同志指出，此次主题教育对统筹推进“五位一体”总体布局、协调推进“四个全面”战略布局，实现“两个一百年”奋斗目标、实现中华民族伟大复兴的中国梦，具有十分重大的意义。指导组将认真学习贯彻习近平总书记重要讲话和重要指示精神，按照党中央和银保监会党委部署，督促长城公司系统各级党组织聚焦根本任务，把握“十二字”总要求，紧扣“五句话”目标，坚持“四个贯穿始终”，力戒形式主义，抓好落实，确保主题教育取得扎实成效。</span><br /><span style=\"color:#4C4C4C;font-family:&quot;font-size:16px;background-color:#FFFFFF;\">&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;公司系统广大党员分别在主会场和分会场参加会议。</span></p>', 1, 1561448827, 3, '/uploads/admin/20190625/b8289caba7f365c552d5a608783c6203.jpg');
INSERT INTO `changcheng_article2019` (`id`, `title`, `description`, `content`, `status`, `addtime`, `typeid`, `pic`) VALUES
(49, '周礼耀总裁会见上海银行副行长施红敏', '6月24日上午，中国长城资产管理股份有限公司总裁周礼耀在公司总部会见上海银行副行长施红敏一行，双方就有关业务合作事宜进行了交流。', '<p class=\"MsoNormal\" align=\"left\" style=\"text-align:center;margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;background-color:#FFFFFF;\"><img src=\"/static/plug/kingeditor/attached/image/20190625/20190625155107_42396.jpg\" alt=\"\" /></p><p class=\"MsoNormal\" align=\"left\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;background-color:#FFFFFF;\">6月24日上午，中国长城资产管理股份有限公司总裁周礼耀在公司总部会见上海银行副行长施红敏一行，双方就有关业务合作事宜进行了交流。双方有关部门负责人参加了会见。</p><p class=\"MsoNormal\" align=\"left\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;background-color:#FFFFFF;\">上海银行股份有限公司成立于1995年12月29日，总行位于上海，是上海证券交易所主板上市公司。近年来着力于在中小企业、财富管理和养老金融、金融市场、跨境金融、在线金融等领域培育和塑造经营特色。上海银行股份有限公司在英国《银行家》杂志公布的2018年全球银行1000强中，按一级资本排名位列全球银行业第76位。</p>', 1, 1561449083, 3, '/uploads/admin/20190625/5bd75059b5ff203252f10c89c141b0e2.jpg'),
(50, '中国长城资产与上海联交所签署战略合作协议', ' 6月28日上午，中国长城资产管理股份有限公司（以下简称“中国长城资产”）与上海联合产权交易所有限公司（以下简称“上海联交所”）在上海签署战略合作协议。', '<p style=\"text-align:center;\"><img src=\"/static/plug/kingeditor/attached/image/20190703/20190703162920_77184.jpg\" alt=\"\" /></p><p style=\"text-align:justify;\"><p align=\"left\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;background-color:#FFFFFF;\">&nbsp;6月28日上午，中国长城资产管理股份有限公司（以下简称“中国长城资产”）与上海联合产权交易所有限公司（以下简称“上海联交所”）在上海签署战略合作协议。中国长城资产副总裁胡小钢与上海联交所总裁钱琎出席签约仪式，中国长城资产运营总监兼上海市分公司总经理陶永平和上海联交所副总裁李杰代表双方签署战略合作协议。双方有关部门和经营单位负责人参加签约仪式。</p><p class=\"MsoNormal\" align=\"left\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;background-color:#FFFFFF;\">签约仪式前，双方进行了友好会谈，表示将以此次签约为契机，加强在不良资产处置、并购重组以及其他金融领域等方面的业务合作，实现互利共赢。</p><p class=\"MsoNormal\" align=\"left\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;background-color:#FFFFFF;\">上海联交所成立于1994年，是经上海市人民政府批准设立的综合性产权交易服务机构，是国务院国资委选定的从事中央企业国有产权转让以及上海国有企业产权转让指定的挂牌交易机构，是集物权、债权、股权、知识产权等交易服务为一体的专业化市场平台。根据国务院国资委数据显示，上海联交所产权交易总量、国有产权交易量、国有产权增值额、产权交易增值率等指标在各产权机构中均名列前茅。2018年，上海联交所成交项目1903项，成交金额约2042.44亿元。</p></p><p><br /></p>', 1, 1562142864, 3, '/uploads/admin/20190703/1115fd55ee2035c4f65df40fc4db74f9.jpg'),
(51, '沈晓明董事长会见花旗银行战略顾问联席全球主管法尔科', ' 7月1日下午，中国长城资产管理股份有限公司董事长沈晓明在公司总部会见花旗银行战略顾问联席全球主管法尔科（Manuel Falco）一行', '<p style=\"text-align:center;\"><img src=\"/static/plug/kingeditor/attached/image/20190703/20190703163143_90529.jpg\" alt=\"\" /></p><p style=\"text-align:justify;\"><span style=\"color:#4C4C4C;font-family:&quot;font-size:16px;background-color:#FFFFFF;\">7月1日下午，中国长城资产管理股份有限公司董事长沈晓明在公司总部会见花旗银行战略顾问联席全球主管法尔科（Manuel Falco）一行，双方相互介绍了业务发展现状，表达了深化合作意愿，并就全球经济金融形势交换了看法。双方有关部门负责人参加了会见。</span></p>', 1, 1562143013, 3, '/uploads/admin/20190703/625c160716cf42feb70cc0bf8628f12d.jpg'),
(52, '中国长城资产开展“不忘初心、牢记使命”主题教育集中学习研讨', '日前，中国长城资产管理股份有限公司党委按照中央关于“不忘初心、牢记使命”主题教育工作部署和银保监会要求，持续开展专题集中学习研讨。', '<p class=\"MsoNormal\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:32pt;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\"><span style=\"font-size:16pt;font-family:仿宋;line-height:32px;\">日前，中国长城资产管理股份有限公司党委按照中央关于</span><span style=\"font-size:16pt;font-family:仿宋;line-height:32px;\">“</span><span style=\"font-size:16pt;font-family:仿宋;line-height:32px;\">不忘初心、牢记使命<span>”</span>主题教育工作部署和银保监会要求，持续开展专题集中学习研讨。<span></span></span></p><p class=\"MsoNormal\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:32pt;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\"><span style=\"font-size:16pt;font-family:仿宋;line-height:32px;\">7</span><span style=\"font-size:16pt;font-family:仿宋;line-height:32px;\">月<span>2</span>日上午和下午，长城公司党委分别以“加强党的政治建设”、“全面从严治党”为主题开展了<span>2</span>次党委中心组学习，分别学习了习近平总书记在</span><span style=\"font-size:16pt;font-family:仿宋;line-height:32px;\">中央政治局第六次集体学习时的讲话和</span><span style=\"font-size:16pt;font-family:仿宋;line-height:32px;\">习近平总书记</span><span style=\"font-size:16pt;font-family:仿宋;line-height:32px;\">在中共十八届六中全会第二次全体会议上的讲话，并围绕相关主题开展集中学习研讨。长城公司党委书记沈晓明主持集体学习，党委副书记周礼耀、胡永康，党委委员胡小钢、邹立文，纪委书记杜胜，总裁助理桑自国、王彤参会发言讨论，党口部门主要负责同志列席会议。<span></span></span></p><p class=\"MsoNormal\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:32pt;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\"><span style=\"font-size:16pt;font-family:仿宋;line-height:32px;\">与会同志共同学习了《习近平总书记关于<span>“</span>不忘初心、牢记使命<span>”</span>重要论述选编》《习近平新时代中国特色社会主义思想学习纲要》《</span><span style=\"font-size:16pt;font-family:仿宋;line-height:32px;\">中国共产党党内重要法规汇编》</span><span style=\"font-size:16pt;font-family:仿宋;line-height:32px;\">的相关部分重点篇目，学习了习近平总书记关于加强党的政治建设和全面从严治党等方面的重要讲话和重要指示精神。<span></span></span></p><p class=\"MsoNormal\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:32pt;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\"><span style=\"font-size:16pt;font-family:仿宋;line-height:32px;\">沈晓明同志要求，公司</span><span style=\"font-size:16pt;font-family:仿宋;line-height:32px;\">要深入贯彻习近平总书记重要讲话精神，扎实开展主题教育，坚持把学习教育贯穿此次主题教育始终。要以读原著、学原文的方式原原本本地学习党的十九大报告和党章党规，习近平新时代中国特色社会主义思想，习近平总书记关于“不忘初心、牢记使命”的重要论述，习近平总书记关于经济金融工作的重要论述，全面理解新思想的核心要义和实践要求，精准理解中央就经济金融工作的要求，自觉对表对标，及时校准工作上的偏差。</span><span style=\"font-size:16pt;font-family:仿宋;line-height:32px;\"></span></p><p class=\"MsoNormal\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:32pt;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\"><span style=\"font-size:16pt;font-family:仿宋;line-height:32px;\">沈晓明同志强调，</span><span style=\"font-size:16pt;font-family:仿宋;line-height:32px;\">贯彻落实习近平新时代中国特色社会主义思想，全面加强党的建设，必须要把“四个意识”贯穿党的政治建设全过程。公司系统全体党员必须牢固树立“四个意识”，切实践行“两个维护”，加强自身学习，强化责任担当，在思想上政治上行动上同以习近平同志为核心的党中央保持高度一致，以实际行动切实履行好国家赋予公司“防范化解金融风险”的使命责任。<span></span></span></p><p class=\"MsoNormal\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:32pt;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\"><span style=\"font-size:16pt;font-family:仿宋;line-height:32px;\">围绕两个学习研讨主题，党委副书记周礼耀、胡永康，党委委员胡小钢、邹立文做了重点发言。</span></p>', 1, 1562143167, 3, '/uploads/admin/20190703/d75db8f762f0208a9ae782e4b9fa039f.png'),
(53, '扎实开展“不忘初心、牢记使命”主题教育 中国长城资产专题研讨落实新发展理念', '7月8日上午，中国长城资产管理股份有限公司党委以“转变发展理念，深化经济金融改革”为主题，开展了“不忘初心、牢记使命”主题教育集中学习专题研讨会。', '<p align=\"left\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;background-color:#FFFFFF;\">7月8日上午，中国长城资产管理股份有限公司党委以“转变发展理念，深化经济金融改革”为主题，开展了“不忘初心、牢记使命”主题教育集中学习专题研讨会。中国长城资产党委书记沈晓明主持集体学习并讲话，中国银保监会第11巡回指导组组长周家龙同志出席会议并作指导讲话，党委副书记周礼耀、胡永康，党委委员孟晓东、胡小钢、邹立文，纪委书记杜胜，总裁助理王彤参会发言讨论，总部各部门主要负责同志列席会议。</p><p class=\"MsoNormal\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\">与会同志共同学习了《习近平总书记关于“不忘初心、牢记使命”重要论述选编》《习近平新时代中国特色社会主义思想学习纲要》的相关部分重点篇目，并结合经济形势、市场趋势和政策变化，就做精做强主业等公司改革发展大计进行了集中研讨。</p><p class=\"MsoNormal\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\">沈晓明同志指出，创新、协调、绿色、开放、共享的发展理念，是指挥棒、红绿灯，是管全局、管根本、管长远的导向。公司系统一是要原原本本学、联系实际学、深入思考学，深学悟透新发展理念，全面理解核心要义，推动公司改革发展。二是要坚决按照党中央和银保监会的要求，坚持合规经营、高质量经营、可持续经营，促进国有资产保值增值，要聚焦主业，做精专业，固本强身，化解金融风险。三是要加强党的政治建设，推进全面从严治党向纵深发展。打铁还需自身硬，要进一步做好巡视整改落实工作，从严从实持续抓好党风廉政建设和反腐败工作。四是要加快公司内部改革，加强干部队伍建设，激发员工热情，增强企业发展动力。</p><p class=\"MsoNormal\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\">周家龙同志在指导讲话中指出，中国长城资产开展“不忘初心、牢记使命”主题教育态度认真、组织周密、推进扎实。周家龙同志强调，学习教育是根本，调查研究是途径，检视问题是关键，整改落实是目的；做好这次主题教育，就是把“守初心、担使命，找差距、抓落实”这十二字要求同长城公司的重点工作任务和特点紧密地结合起来，在深入学习理论和扎实开展调研的基础上讲好专题党课，在广泛听取意见建议的基础上深刻剖析反思，在查摆问题的基础上整改落实，聚焦主责主业、缩表瘦身、提质增效，积极防范化解金融风险，支持供给侧结构性改革，提升服务实体经济质效，在全系统干部职工中统一思想认识，推动主题教育目标任务的实现。</p><p class=\"MsoNormal\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\">围绕学习研讨主题，党委副书记周礼耀、胡永康做了重点发言。&nbsp;</p>', 1, 1562830806, 3, '/uploads/admin/20190711/2e83dd53b2e1e652118729a5bd289d38.png'),
(54, '中国长城资产党委研究部署在全系统开展警示教育', '中央纪委国家监委驻银保监会纪检监察组会同北京市纪委监委对中国长城资产管理股份有限公司总裁助理桑自国因个人涉嫌严重违纪违法立案审查调查后，中国长城资产党委高度重视，立即召开党委会研究部署在全系统开展警示教育。 ', '<span style=\"color:#4C4C4C;font-family:&quot;font-size:16px;background-color:#FFFFFF;\">中央纪委国家监委驻银保监会纪检监察组会同北京市纪委监委对中国长城资产管理股份有限公司总裁助理桑自国因个人涉嫌严重违纪违法立案审查调查后，中国长城资产党委高度重视，立即召开党委会研究部署在全系统开展警示教育。&nbsp;</span><p class=\"MsoNormal\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\">中国长城资产党委坚决拥护中央纪委国家监委的决定，坚决贯彻落实中国银保监会党委、中央纪委国家监委驻银保监会纪检监察组的工作部署，坚定不移地在思想上政治上行动上同党中央保持高度一致，坚定不移地推进公司系统党风廉政建设和反腐败斗争。</p><p class=\"MsoNormal\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\">公司党委要求，系统各级党组织和全体干部职工一定要把思想和行动统一到中央精神上来，以桑自国接受审查调查为反面教材，认真汲取教训、深刻反思，对照检查、加强整改，切实增强纪律和规矩意识，进一步落实党中央关于全面从严治党和反腐败的各项重大部署。</p><p class=\"MsoNormal\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\">会议强调，要坚定不移推进党风廉政建设和反腐败斗争。系统各级党委要认真履行全面从严治党主体责任，各级纪委要认真履行监督责任，全体党员领导干部要自觉担负起管党治党的“一岗双责”政治责任，抓好分管领域的党风廉政建设，坚决维护党规党纪的严肃性，真正把党风廉政建设各项决策部署落到实处。</p><p class=\"MsoNormal\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\">会议要求，公司系统要结合“不忘初心、牢记使命”主题教育，进一步开展警示教育，聚焦反腐败斗争，持续加大党风廉政建设力度，把全面从严治党、从严治司引向深入，确保党中央决策部署在公司系统坚决贯彻落实到位。</p>', 1, 1562831313, 3, '/uploads/admin/20190711/12899834a6969b0ea77e80100db0bbff.png'),
(55, '中国长城资产党委组织集体参观“复兴之路”展览', '7月10日下午，中国长城资产管理股份有限公司党委按照“不忘初心、牢记使命”主题教育活动安排，组织公司领导班子成员和各部门主要负责同志集体前往国家博物馆参观“复兴之路”大型主题展览。', '<p class=\"MsoNormal\" style=\"text-align:justify;margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;background-color:#FFFFFF;\"><img src=\"/static/plug/kingeditor/attached/image/20190711/20190711155338_70711.jpg\" alt=\"\" /></p><p class=\"MsoNormal\" style=\"text-align:justify;margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;background-color:#FFFFFF;\">7月10日下午，中国长城资产管理股份有限公司党委按照“不忘初心、牢记使命”主题教育活动安排，组织公司领导班子成员和各部门主要负责同志集体前往国家博物馆参观“复兴之路”大型主题展览。</p><p class=\"MsoNormal\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\">公司领导班子一行首先参观了“复兴之路”展览的基本陈列部分，深入了解了1840年鸦片战争以来，陷入半殖民地半封建社会深渊的中国各阶层人民在屈辱苦难中奋起抗争，为实现民族复兴进行的种种探索，特别是中国共产党领导全国各族人民争取民族独立人民解放、国家富强人民幸福的光辉历程。</p><p class=\"MsoNormal\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\">随后，公司领导班子一行重点参观了“复兴之路”展览的新时代部分——“不忘初心 砥砺奋进 不断开创新时代中国特色社会主义事业新局面”。系统回顾了党的十八大以来，以习近平同志为核心的党中央团结带领全国各族人民，统筹推进“五位一体”总体布局，协调推进“四个全面”战略布局，党和国家各项事业发生的历史性变革，取得的历史性成就。</p><p class=\"MsoNormal\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\">大家通过参观展览，进一步巩固和拓展了前期理论学习的成果，深化了对习近平新时代中国特色社会主义思想的理解和认识。大家一致表示，我们在金融领域为党和国家工作，一定要进一步增强“四个意识”、坚定“四个自信”、做到“两个维护”，坚持以习近平新时代中国特色社会主义思想为指导，在政治立场、政治方向、政治原则、政治道路上同以习近平同志为核心的党中央保持高度一致，不忘初心、牢记使命、永远奋斗，以更加饱满的热情、更加昂扬的状态、更加扎实的工作，坚决贯彻落实党中央的决策部署和银保监会的任务要求，确保完成党和国家赋予我们“防范化解金融风险”的使命责任。</p><p class=\"MsoNormal\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\">中国长城资产党委书记沈晓明，党委副书记周礼耀、胡永康，党委委员孟晓东、胡小钢、邹立文，纪委书记杜胜，总裁助理王彤和总部各部门主要负责同志参加参观活动。</p>', 1, 1562831628, 3, '/uploads/admin/20190711/3fc7112531a9d30006b988d06e422aee.jpg'),
(56, '中国长城资产第六次荣获中国银行业最佳社会责任实践案例奖', '7月17日上午，中国银行业协会召开《2018年中国银行业社会责任报告》发布暨社会责任百佳表彰大会，会议表彰了在2018年社会责任工作中作出突出贡献的单位和个人，中国长城资产管理股份有限公司荣获2018年度中国银行业最佳社会责任实践案例奖。', '<p style=\"text-align:center;\"><img src=\"/static/plug/kingeditor/attached/image/20190725/20190725134634_55636.jpg\" alt=\"\" /></p><p style=\"text-align:justify;\"><p style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\">&nbsp;7月17日上午，中国银行业协会召开《2018年中国银行业社会责任报告》发布暨社会责任百佳表彰大会，会议表彰了在2018年社会责任工作中作出突出贡献的单位和个人，中国长城资产管理股份有限公司荣获2018年度中国银行业最佳社会责任实践案例奖。这是继2012年、2013年、2015年、2016年、2017年之后，中国长城资产第六次获此殊荣。</p><p style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\"><img src=\"/static/plug/kingeditor/attached/image/20190725/20190725134724_38796.jpg\" alt=\"\" /></p><p style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\"><span style=\"color:#4C4C4C;font-family:&quot;font-size:16px;background-color:#FFFFFF;\">自成立以来，中国长城资产积极履行社会责任，依托不良资产主业及集团多元化金融服务工具箱，创造了多个成功的主动性债转股案例，助力企业防范化解风险，有力支持了供给侧结构改革和实体经济发展。此次获奖案例是助力中铁物市场化法制化债转股项目，该项目的成功实施，检验了资产公司并购重组业务能力在化解大型企业集团危机中的作用，探索了盘活国有存量资产、深化供给侧改革的新路径，彰显了中国长城资产作为中央金融企业的社会责任，从而成为长城资产继2015年成功化解国内首单公募债暨“11超日债”违约危机后，在新时期防范化解系统性金融风险、服务实体经济发展的又一重大成果。</span></p><p align=\"center\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;background-color:#FFFFFF;\">&nbsp;</p></p>', 1, 1564033830, 3, '/uploads/admin/20190725/4634ec9d21183e78d369f9243806d868.jpg'),
(57, '中国长城资产召开2019年中工作会议', ' 7月22-23日，中国长城资产管理股份有限公司在青岛召开2019年中工作会议。', '<p style=\"text-align:center;\"><img src=\"/static/plug/kingeditor/attached/image/20190725/20190725135342_11332.jpg\" alt=\"\" /></p><p style=\"text-align:justify;\"><p style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\">中国长城资产党委书记、董事长沈晓明作重要讲话，党委副书记、执行董事、总裁周礼耀作上半年经营情况工作报告，党委副书记、监事长胡永康主持会议，党委委员、副总裁孟晓东、胡小钢、邹立文，总裁助理杨国兵、王彤出席了会议。银保监会有关领导受邀出席了会议。公司董事、监事，董事会秘书，公司总监，各经营单位和总部各部门负责人、派驻平台公司总经理级专职董监事参加了会议。</p><p style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\"><br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 沈晓明董事长指出，上半年，面对复杂多变的外部形势和持续加大的内部经营压力，公司在银保监会、财政部、人民银行等部门的大力支持下，认真贯彻党中央国务院部署，按照年初的工作安排，积极落实“回归本源、聚焦主业、做精专业”的发展要求，各项工作取得了积极成效。</p><p style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\"><br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 截至6月末，集团净资产694.68亿元，较年初增长13.58%；公司法人口径资本充足率为14.43%，主要指标均符合监管要求。3月、4月分别成功发行两期各150亿元中长期金融债券，公司融资渠道进一步拓宽；上半年外部融资加权利率较年初降低43BP，负债成本得到有效控制。</p><p style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\"><br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 上半年，公司不良资产主业拓展重心稳步转换，重点围绕问题资源开展实质性并购重组等综合性“大不良”业务，公司总计出资95.64亿元收购了总额395.18亿元的金融不良资产债权，累计处置回现166.18亿元。</p><p style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\"><br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;对于下半年的业务经营工作，沈晓明董事长提出了五个总体要求：一是讲政治，坚持党的领导，坚决同以习近平同志为核心的党中央保持高度一致，自觉维护党中央权威，知敬畏、存戒惧、守底线，做到“五个必须”、防止“七个有之”，做政治上的明白人，切实增强纪律和规矩意识，进一步落实党中央关于全面从严治党和反腐败的各项重大部署。二是促创新，抓住《金融资产管理公司资本管理办法》这个立足点，科学规划公司资本，全面推进公司各项改革，打造转型发展模式升级版。三是克难关，要有抢先抓早的意识、坚持不懈的干劲、攻坚克难的韧劲，打赢风险防范化解攻坚战。四是补短板，不断激发经营单位的经营活力，推动竞争能力实现再提升。五是树信心，加强队伍建设，优化用人机制，打造作风优良的生态圈，全面弘扬担当有为主旋律。</p><p style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\"><br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 周礼耀总裁代表公司经营管理层，对上半年经营情况做了具体分析，指出了公司经营中存在的突出问题，强调下半年公司经营工作要抓住“三个重点”，做好“三个落实”，实现“三个突破”，并作出了具体的工作部署。</p><p style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\"><br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 会议期间，与会代表围绕沈晓明董事长的重要讲话和周礼耀总裁的工作报告，就贯彻落实会议精神、做好下半年工作进行了热烈讨论。部分分、子公司做了经验交流发言。</p></p>', 1, 1564034066, 3, '/uploads/admin/20190725/6aaa8d89454f9ddf5552a560bd2532a4.jpg'),
(58, '中国长城资产与交通银行签署战略合作协议', '7月26日上午，中国长城资产管理股份有限公司（以下简称“中国长城资产”）与交通银行股份有限公司（以下简称“交通银行”）在上海签署战略合作协议。', '<p style=\"text-align:justify;margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;background-color:#FFFFFF;\"><img src=\"/static/plug/kingeditor/attached/image/20190808/20190808161235_59700.jpg\" alt=\"\" /></p><p style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\">7月26日上午，中国长城资产管理股份有限公司（以下简称“中国长城资产”）与交通银行股份有限公司（以下简称“交通银行”）在上海签署战略合作协议。中国长城资产董事长沈晓明与交通银行行长任德奇出席签约仪式，中国长城资产总裁助理王彤与交通银行副行长吕家进代表双方签署战略合作协议。双方有关部门和机构负责人参加了签约仪式。</p><p style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\"><br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 签约仪式前，沈晓明董事长和任德奇行长进行了深入友好会谈，双方互相介绍了公司发展现状与未来发展方向，并表示将以此次签约为契机，发挥各自专业领域优势，进一步加强不良资产处置、同业授信、同业负债、债券发行及投资、IPO上市以及子公司的合作，实现互利共赢。中国长城资产与交通银行前期有着良好的合作基础，此次战略合作协议的签署，标志着双方的合作关系将进一步紧密和深化。</p><p style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\"><br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 交通银行始建于1908年，是中国第一家全国性的国有股份制商业银行，2005年6月在香港联合交易所挂牌上市，2007年5月在上海证券交易所挂牌上市。截至2018年末，交通银行共有境内分行机构238家，在全国共设有3241个营业网点，旗下拥有7家主要非银子公司。2018年，交通银行已连续十年跻身《财富》（FORTUNE）世界500强，营业收入排名第168位；位列《银行家》（The Banker）杂志全球千家大银行一级资本排名第11位。截至2018年末，交通银行资产总额达95311.71亿元，全年实现净利润736.3亿元，不良率、拨备覆盖率和资本充足率分别为1.49%、173.13%和14.37%。</p>', 1, 1565251964, 3, '/uploads/admin/20190808/8609cb8ad703bfa9be5837f5aa6fa484.jpg'),
(59, '沈晓明书记在公司系统做主题教育专题党课 强调要牢记初心使命 服务经济高质量发展', '根据公司“不忘初心、牢记使命”主题教育部署安排，7月30日下午，中国长城资产管理股份有限公司党委书记沈晓明以《不忘化解风险初心，牢记金融安全使命》为题，为公司全体党员和入党积极分子讲授专题党课。', '<p class=\"MsoNormal\" style=\"text-align:justify;margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;background-color:#FFFFFF;\"><img src=\"/static/plug/kingeditor/attached/image/20190808/20190808161525_12770.jpg\" alt=\"\" /></p><p class=\"MsoNormal\" style=\"text-align:justify;margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;background-color:#FFFFFF;\"><span style=\"color:#4C4C4C;font-family:&quot;font-size:16px;background-color:#FFFFFF;\">中国长城资产召开“不忘初心、牢记使命”主题教育党委书记讲党课会议</span></p><p class=\"MsoNormal\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\">根据公司“不忘初心、牢记使命”主题教育部署安排，7月30日下午，中国长城资产管理股份有限公司党委书记沈晓明以《不忘化解风险初心，牢记金融安全使命》为题，为公司全体党员和入党积极分子讲授专题党课。党委副书记胡永康主持会议，党委副书记周礼耀，党委委员胡小钢、邹立文，纪委书记杜胜，总裁助理杨国兵出席。</p><p class=\"MsoNormal\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\">沈晓明同志阐释解读了公司的初心和使命，回顾了公司二十年来精彩生动的改革发展历程，总结了公司在政策性经营时期、商业化转型时期以及近两年发展新时期所取得的历史成绩，擘画了公司未来发展蓝图。他强调，牢记我们的初心和使命，才能充分发挥金融资产管理公司“盘活存量、优化增量”的独特功能，才能构建完善可持续发展的业务模式，才能在现代化经济金融体系中确立中国长城资产的地位和存在价值，才能更好地服务经济高质量发展。</p><p class=\"MsoNormal\" style=\"text-align:justify;margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;background-color:#FFFFFF;\"><img src=\"/static/plug/kingeditor/attached/image/20190808/20190808161543_15040.jpg\" alt=\"\" /></p><p class=\"MsoNormal\" style=\"text-align:justify;margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;background-color:#FFFFFF;\"><span style=\"color:#4C4C4C;font-family:&quot;font-size:16px;background-color:#FFFFFF;\">中国长城资产党委书记沈晓明讲党课</span></p><p class=\"MsoNormal\" style=\"text-align:justify;margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;background-color:#FFFFFF;\"><p class=\"MsoNormal\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\">沈晓明同志指出，不忘初心，方得始终，牢记使命，方能致远。“为中国人民谋幸福，为中华民族谋复兴”是中国共产党人的初心使命，是激励一代代中国共产党人前赴后继、英勇奋斗的根本动力。“防范化解金融风险，守护国家金融安全，服务支持经济发展”是我们长城人的初心使命，是激励我们改革发展、砥砺前行的根本动力。</p><p class=\"MsoNormal\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\">沈晓明同志强调，今年是我们实现转型发展的关键一年。公司系统全体干部职工要以习近平新时代中国特色社会主义思想为指引，将开展“不忘初心、牢记使命”主题教育与学习贯彻习总书记对金融工作的一系列重要指示精神紧密结合起来，更加扎实地把党中央各项决策部署落到实处,把银保监会党委的各项工作要求落到实处，把公司党委的各项任务计划落到实处，齐心协力、奋斗拼搏，自觉激发干事创业的激情，全力做好下半年的业务攻坚，推动公司实现高质量发展！</p><p class=\"MsoNormal\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\">总部及部分在京平台公司全体党员及部分非党员在主会场，各分公司和其他平台公司全体党员及部分非党员在各自分会场参加了会议。</p></p>', 1, 1565252206, 3, '/uploads/admin/20190808/e975fb8820ed5856b62725d915b48ed4.jpg'),
(60, '中国长城资产与百步亭集团签署战略合作协议', '8月16日上午，中国长城资产管理股份有限公司与百步亭集团有限公司在武汉签署战略合作协议。中国长城资产总裁周礼耀与百步亭集团董事局主席茅永红出席签约仪式。', '<p style=\"text-align:justify;margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;background-color:#FFFFFF;\"><img src=\"/static/plug/kingeditor/attached/image/20190827/20190827143216_81951.jpg\" alt=\"\" /></p><p style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\">8月16日上午，中国长城资产管理股份有限公司与百步亭集团有限公司在武汉签署战略合作协议。中国长城资产总裁周礼耀与百步亭集团董事局主席茅永红出席签约仪式。中国长城资产总裁助理杨国兵和百步亭集团副总裁刘宜蓉代表双方签署战略合作协议。百步亭集团总裁王波以及双方有关负责同志参加签约仪式。</p><p style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\">签约仪式前，中国长城资产总裁周礼耀与百步亭集团董事局主席茅永红进行了深入友好的会谈。双方互相介绍了公司发展现状与未来发展方向，并一致表示将以此次签约为契机，发挥各自领域专业优势，加强在资产经营管理、并购重组以及基金投资、金融服务等方面的业务合作，实现互利共赢。</p><p style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\">百步亭集团有限公司是以社区地产业为主，社区服务业、金融投资、船舶产业、文化产业和医药经营等多元发展的民营企业集团，拥有武汉安居工程发展有限公司、百步亭物业管理有限公司、百步亭国际传媒有限公司等20家下属企业。百步亭集团有限公司连续多年被评为全国房地产100强、全国民营企业500强、中国服务业500强和全国最具社会责任感民营企业。截至2019年3月末，百步亭集团有限公司总资产达到213.21亿元。</p>', 1, 1566887585, 3, '/uploads/admin/20190827/822a0867cc46e10613184aa1d77bcf71.jpg'),
(61, '沈晓明董事长会见恒大集团总裁夏海钧', '9月4日上午，中国长城资产管理股份有限公司董事长沈晓明在公司总部会见恒大地产集团有限公司总裁夏海钧一行，双方就各自经营现状和深化业务合作进行了友好交流。', '<p class=\"MsoNormal\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:32pt;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\"><span style=\"font-size:16pt;font-family:仿宋;line-height:32px;\"><img src=\"/static/plug/kingeditor/attached/image/20190905/20190905153924_20362.jpg\" alt=\"\" /><br /></span></p><p class=\"MsoNormal\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:32pt;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\"><span style=\"font-size:16pt;font-family:仿宋;line-height:32px;\">9</span><span style=\"font-size:16pt;font-family:仿宋;line-height:32px;\">月<span>4</span>日上午，中国长城资产管理股份有限公司董事长沈晓明在公司总部会见恒大地产集团有限公司总裁夏海钧一行，双方就各自经营现状和深化业务合作进行了友好交流。中国长城资产总裁周礼耀，副总裁孟晓东，恒大新能源科技集团董事长刘永灼，恒大集团副总裁谈朝晖、姜丽明、陈琬，以及双方有关部门负责人参加会见。<span></span></span></p><p class=\"MsoNormal\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:32pt;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\"><span style=\"font-size:16pt;font-family:仿宋;line-height:32px;\">恒大地产集团有限公司成立于<span>1997</span>年，是以地产为基础，文化旅游、健康养生为两翼，新能源汽车为龙头的世界<span>500</span>强企业集团。截至目前，恒大集团总资产<span>2.1</span>万亿元，年销售规模超<span>6000</span>亿元，员工<span>14</span>万人，在全国<span>180</span>多个城市拥有<span>500</span>多个地产项目，是国内规模最大的房地产企业。</span><span style=\"font-size:16pt;font-family:仿宋;line-height:32px;\"></span></p><p style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\">&nbsp;</p>', 1, 1567669196, 3, '/uploads/admin/20190905/b32bad6a5edd440bf1069c98fb55652e.jpg'),
(62, '公司领导受邀到天安门观礼新中国70周年庆典', '10月1日上午，庆祝中华人民共和国成立70周年大会在北京天安门广场隆重举行，中国长城资产董事长沈晓明、总裁周礼耀、监事长胡永康受邀到天安门观礼，并参加当日晚间的庆祝中华人民共和国成立70周年联欢活动。', '<p style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\">10月1日上午，庆祝中华人民共和国成立70周年大会在北京天安门广场隆重举行，中国长城资产董事长沈晓明、总裁周礼耀、监事长胡永康受邀到天安门观礼，并参加当日晚间的庆祝中华人民共和国成立70周年联欢活动。</p><p align=\"center\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;background-color:#FFFFFF;\"><img alt=\"\" src=\"http://www.gwamcc.com/kindeditor/attached/image/20191008/20191008101248_1387.jpg\" style=\"vertical-align:middle;\" /></p><p style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\"><br /></p><p align=\"center\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;background-color:#FFFFFF;\"><span style=\"font-size:10px;\">沈晓明董事长在天安门广场观礼</span></p><p style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\">“非常荣幸在天安门广场参与和见证了国庆70周年庆典，尤其是近距离聆听习近平总书记重要讲话，观看庆祝大会、阅兵活动和群众游行盛况，内心感到无比激动，由衷为伟大的祖国感到自豪。”曾以行业优秀集体代表身份参加过60周年庆典观礼的沈晓明董事长表示，与上次相比，这次庆典盛况空前，尤其是阅兵式雄壮有力，群众游行精彩纷呈，充分体现了祖国国力更强盛，人民幸福感更充实、精气神更饱满，充分体现了祖国70年来社会、经济、军事等方方面面取得的巨大成绩。作为一名金融工作者，将不忘初心、牢记使命，不负韶华、砥砺前行，为祖国的经济金融事业贡献更大力量。</p><p align=\"center\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;background-color:#FFFFFF;\"><img alt=\"\" src=\"http://www.gwamcc.com/kindeditor/attached/image/20191008/20191008101318_9508.jpg\" style=\"vertical-align:middle;\" /></p><p style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\"><br /></p><p align=\"center\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;background-color:#FFFFFF;\"><span style=\"font-size:10px;\">周礼耀总裁、胡永康监事长在天安门广场观礼</span></p><p style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\">此次大会邀请了包括优秀共产党员、人民满意的公务员、时代楷模、优秀企业家、最美人物、大国工匠、优秀农民工等各行各界的先进模范人物代表参加观礼。&nbsp;</p>', 1, 1570513647, 3, '/uploads/admin/20191008/43b524f88c845931b7eafc41f8677e9b.jpg'),
(63, '中国长城资产二十周年成就展揭幕开展', '“基业长青——中国长城资产二十周年成就展”日前在公司二楼报告厅揭幕开展。公司董事长沈晓明，总裁周礼耀，监事长胡永康，副总裁孟晓东、胡小钢、邹立文，纪委书记杜胜，总裁助理杨国兵、王彤一同参观展览。', '<p align=\"center\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;background-color:#FFFFFF;\"><span style=\"font-size:10px;\"><img alt=\"\" src=\"http://www.gwamcc.com/kindeditor/attached/image/20191017/20191017144754_8027.jpg\" style=\"vertical-align:middle;\" /></span></p><p align=\"center\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;background-color:#FFFFFF;\"><span style=\"font-size:10px;\">公司领导在二十周年成就展现场合影</span></p><p align=\"left\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;background-color:#FFFFFF;\">“基业长青——中国长城资产二十周年成就展”日前在公司二楼报告厅揭幕开展。公司董事长沈晓明，总裁周礼耀，监事长胡永康，副总裁孟晓东、胡小钢、邹立文，纪委书记杜胜，总裁助理杨国兵、王彤一同参观展览。&nbsp;&nbsp;</p><p align=\"center\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;background-color:#FFFFFF;\"><img alt=\"\" src=\"http://www.gwamcc.com/kindeditor/attached/image/20191017/20191017105256_3565.jpg\" style=\"vertical-align:middle;\" /></p><p align=\"center\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;background-color:#FFFFFF;\"><span style=\"font-size:10px;\">公司领导参观展览</span></p><p style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\">二十年时光荏苒、风雨兼程，二十年矢志不渝、砥砺前行。“基业长青——中国长城资产二十周年成就展”分为经营发展、系统党建、内部管理、社会责任、企业文化、大事记等部分。展览围绕“化解金融风险、提升资产价值，建设行业一流、基业长青的综合金融服务商”这一主题，充分宣传和展示了公司历任领导集体团结带领全体干部职工，同心同德，开拓进取，奋力拼搏，圆满完成了国家赋予的使命职责，尤其是近五年来，公司成功股改、战略引资，夯实主业、创新发展，强党建促合规控风险，成功开创了长城事业稳健发展的新局面，展现出新成就、新亮点、新风貌，彰显了长城人忠于金融事业、胸怀使命担当、永远砥砺奋进的精神品格和价值追求，昭示巍巍长城必将迎来更加灿烂辉煌的明天。</p><p style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\">&nbsp;</p>', 1, 1571640924, 3, '/uploads/admin/20191021/36bae5a93f3866642af4ebe67cb12a70.jpg'),
(67, '周礼耀总裁拜会中国科学院党委委员、秘书长邓麦村', '11月11日下午，中国长城资产管理股份有限公司总裁周礼耀一行赴中国科学院拜会中科院党委委员、秘书长邓麦村，双方就未来进一步加强合作进行了深入交流。双方有关部门和单位负责人参加了会面。', '<p align=\"center\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;background-color:#FFFFFF;\"><img alt=\"\" src=\"http://www.gwamcc.com/kindeditor/attached/image/20191112/20191112123652_3589.jpg\" style=\"vertical-align:middle;\" /></p><p style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\">11月11日下午，中国长城资产管理股份有限公司总裁周礼耀一行赴中国科学院拜会中科院党委委员、秘书长邓麦村，双方就未来进一步加强合作进行了深入交流。双方有关部门和单位负责人参加了会面。</p>', 1, 1573624036, 3, '/uploads/admin/20191113/0a586f3be191c7c56862fcfb4033864d.jpg'),
(68, '中国长城资产荣获第一财经金融价值榜“年度AMC”奖', '11月15日，国内一流财经媒体《第一财经》评选的“第一财经金融价值榜”在上海揭晓年度榜单，中国长城资产凭借在“防范化解金融风险，服务实体经济发展”等方面的突出表现荣获2019年“年度AMC”奖。当日下午，上海分公司代表总部前往颁奖典礼现场领取该奖项。', '<p align=\"center\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;background-color:#FFFFFF;\"><img alt=\"\" src=\"http://www.gwamcc.com/kindeditor/attached/image/20191118/20191118161724_6492.jpg\" style=\"vertical-align:middle;\" /></p><p align=\"center\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;background-color:#FFFFFF;\"><span style=\"font-size:10px;\">公司获评“2019第一财经金融价值榜·年度AMC”</span></p><p style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\">11月15日，国内一流财经媒体《第一财经》评选的“第一财经金融价值榜”在上海揭晓年度榜单，中国长城资产凭借在“防范化解金融风险，服务实体经济发展”等方面的突出表现荣获2019年“年度AMC”奖。当日下午，上海分公司代表总部前往颁奖典礼现场领取该奖项。</p><p align=\"center\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;background-color:#FFFFFF;\"><img alt=\"\" src=\"http://www.gwamcc.com/kindeditor/attached/image/20191118/20191118161702_9123.jpg\" style=\"vertical-align:middle;\" /></p><p align=\"center\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;background-color:#FFFFFF;\"><span style=\"font-size:10px;\">上海分公司代表总部领奖</span></p><p style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\">第一财经金融价值榜（CFV, China Financial Value Ranking）是《第一财经》集全媒体之力打造的年度金融评选品牌。截至2019年，CFV记录了十三年来全球金融的动荡巨变，见证了中国金融的崛起、改革和前行。</p>', 1, 1574143512, 3, '/uploads/admin/20191119/28b997e76baff12aa46360998ce4e70c.jpg'),
(69, '沈晓明董事长会见协鑫集团董事长朱共山', '11月20日上午，中国长城资产管理股份有限公司董事长沈晓明在公司总部会见协鑫集团董事长朱共山一行，双方就有关业务合作进行了亲切交流。', '<p align=\"center\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;background-color:#FFFFFF;\"><img alt=\"\" src=\"http://www.gwamcc.com/kindeditor/attached/image/20191120/20191120114259_2370.jpg\" style=\"vertical-align:middle;\" /></p><p style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-size:16px;color:#4C4C4C;font-family:&quot;text-align:justify;background-color:#FFFFFF;\">&nbsp;</p><span style=\"color:#4C4C4C;font-family:&quot;font-size:16px;background-color:#FFFFFF;\">&emsp;&emsp;11月20日上午，中国长城资产管理股份有限公司董事长沈晓明在公司总部会见协鑫集团董事长朱共山一行，双方就有关业务合作进行了亲切交流。</span><br /><span style=\"color:#4C4C4C;font-family:&quot;font-size:16px;background-color:#FFFFFF;\">&emsp;&emsp;中国长城资产总裁助理王彤，协鑫集团副董事长孙玮，以及双方有关部门负责人参加会见。</span>', 1, 1574650028, 3, '/uploads/admin/20191125/a5022132db6719e86cfa23727a5ac379.jpg'),
(70, '中国长城资产管理股份有限公司原总裁助理桑自国被“双开”', '1月6日，中央纪委国家监委网站公布了对中国长城资产管理股份有限公司原总裁助理桑自国的处理决定。依据《中国共产党纪律处分条例》《中华人民共和国监察法》等规定，经中国银保监会党委研究决定，给予桑自国开除党籍、开除处分，收缴其违纪违法所得；经北京市监委研究决定，将桑自国涉嫌犯罪问题移送检察机关依法审查起诉，所涉财物随案移送。', '<p style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-family:&quot;background-color:#FFFFFF;\">1月6日，中央纪委国家监委网站公布了对中国长城资产管理股份有限公司原总裁助理桑自国的处理决定。依据《中国共产党纪律处分条例》《中华人民共和国监察法》等规定，经中国银保监会党委研究决定，给予桑自国开除党籍、开除处分，收缴其违纪违法所得；经北京市监委研究决定，将桑自国涉嫌犯罪问题移送检察机关依法审查起诉，所涉财物随案移送。</p><p class=\"MsoNormal\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-family:&quot;background-color:#FFFFFF;\">中国长城资产及时召开党委扩大会议，传达学习银保监会党委对桑自国严重违纪违法问题的处理决定。银保监会党委、驻会纪检监察组有关负责同志，公司党委委员出席会议，总裁助理、总部各部门和有关单位主要负责同志列席会议。</p><p class=\"MsoNormal\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-family:&quot;background-color:#FFFFFF;\">中国长城资产党委坚决拥护中国银保监会党委给予桑自国开除党籍和开除的处分决定，坚定不移地在思想上政治上行动上同以习近平同志为核心的党中央保持高度一致，坚决贯彻落实中国银保监会党委、中央纪委国家监委驻中国银保监会纪检监察组的工作部署，全面落实管党治党政治责任，扎实做好以案为鉴、以案促改工作，坚定不移把公司系统全面从严治党向纵深推进。</p><p class=\"MsoNormal\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-family:&quot;background-color:#FFFFFF;\">会议认为，桑自国的行为严重违反党的纪律和国家法律法规，并涉嫌犯罪，性质恶劣、情节严重。银保监会党委和北京市监委对桑自国严重违纪违法案件的严肃处理，充分体现了党中央全面从严治党的坚强决心，表明了党中央及银保监会党委有腐必惩的鲜明态度，体现了反腐败零容忍、全覆盖、无禁区的坚定意志，深得党心民心。</p><p class=\"MsoNormal\" style=\"margin-top:10px;margin-bottom:0px;padding:0px;text-indent:2em;font-family:&quot;background-color:#FFFFFF;\">会议强调，公司全系统各级党组织和广大党员干部要牢固树立“四个意识”，增强“四个自信”，以桑自国严重违纪违法案件为反面教材，认真汲取教训、深刻反思，对照检查、加强整改，从党的建设、公司治理、选人用人、业务发展等方面开展一次深刻的反思和检讨。一要坚定不移地坚持党的领导和加强党的建设。完善党组织在决策、执行、监督等环节的权责和工作方式，充分发挥党组织在公司治理中的核心作用。二是坚持党要管党、全面从严治党。系统各级党委要认真履行全面从严治党主体责任，各级纪委要认真履行监督责任，真正把党风廉政建设各项决策部署落到实处。三是严格政治标准选人用人，打造忠诚干净担当干部队伍。坚定选人用人政治方向，强化选人用人政治标尺，营造公平正义、风清气正的政治生态。四是坚决回归不良资产主业。要深入贯彻落实党中央、国务院精神及银保监会监管要求，进一步加大不良资产主业力度，防范化解重大金融风险，支持深化供给侧结构性改革，不断提升服务实体经济效率。</p><div><br /></div>', 1, 1584945174, 3, '/uploads/admin/20200115/dcc3463d8daf1ac382b5f1a92c7c4f27.png'),
(71, '中国长城资产捐款500万元 全力支持湖北抗击肺炎疫情', '心系湖北、众志成城，中国长城资产在行动。\n\n近日来，新型冠状病毒感染的肺炎疫情加速蔓延，防控工作刻不容缓。奋战在湖北抗击疫情一线的“白衣天使们”冒着生命危险对抗病毒，不知疲倦、不畏生死，展现了中华儿女坚强勇敢、大爱无疆的奉献精神。', '<p style=\"margin-top:10px;margin-bottom:0px;color:#4C4C4C;font-family:&quot;background-color:#FFFFFF;font-size:16px;text-align:justify;padding:0px;text-indent:2em;\">心系湖北、众志成城，中国长城资产在行动。</p><p style=\"margin-top:10px;margin-bottom:0px;color:#4C4C4C;font-family:&quot;background-color:#FFFFFF;font-size:16px;text-align:justify;padding:0px;text-indent:2em;\">近日来，新型冠状病毒感染的肺炎疫情加速蔓延，防控工作刻不容缓。奋战在湖北抗击疫情一线的“白衣天使们”冒着生命危险对抗病毒，不知疲倦、不畏生死，展现了中华儿女坚强勇敢、大爱无疆的奉献精神。</p><p style=\"margin-top:10px;margin-bottom:0px;color:#4C4C4C;font-family:&quot;background-color:#FFFFFF;font-size:16px;text-align:justify;padding:0px;text-indent:2em;\">一方有难，八方支援。为支持武汉、支持湖北抗击此次疫情，1月28日，中国长城资产管理股份有限公司携所属分、子公司向湖北省慈善总会捐款人民币500万元，支持奋战在一线的医务工作者，全力支援疫情防控工作。</p><p style=\"margin-top:10px;margin-bottom:0px;color:#4C4C4C;font-family:&quot;background-color:#FFFFFF;font-size:16px;text-align:justify;padding:0px;text-indent:2em;\">自新型冠状病毒感染的肺炎疫情发生以来，中国长城资产党委高度重视，坚决贯彻落实党中央、国务院的决策部署，以对党和国家、对人民高度负责的态度，深刻认识到疫情形势的严峻性、复杂性、紧迫性，牢记使命、扛起责任，把疫情防控工作作为当前最重要的工作来抓。公司系统各经营单位实行一把手负责制，层层落实工作责任，细化各项防控措施，注重控防与保障相结合，全面开展排查，建立零报告制度动态关注疫情并及时应对，严格执行应急值班制度。加强办公场所、员工食堂和营业场所灭菌消毒，配备口罩、洗手液、消毒液等安全防护用品。强化对员工和客户的预防知识宣传，大力宣传疫情防控知识，提高员工安全防范意识，加强对员工的关心关爱，增强广大员工及客户的自我防病意识和社会信心，坚决做好各项防控工作。</p><p style=\"margin-top:10px;margin-bottom:0px;color:#4C4C4C;font-family:&quot;background-color:#FFFFFF;font-size:16px;text-align:justify;padding:0px;text-indent:2em;\">面对新型冠状病毒感染的肺炎疫情蔓延的严峻形势，中国长城资产表示，在党中央、国务院的坚强领导下，中国长城资产始终充满信心、牢记中央金融企业的使命职责，与全国人民和社会各界众志成城、共克时艰，坚决打赢疫情防控阻击战，共同迎接美好明天。</p>', 1, 1584945192, 3, '/uploads/admin/20200317/ea0f6b7ea0fbbd1a0619ddc0098095df.png'),
(72, '中国长城资产与中国科学院签署战略合作协议', '日前，中国长城资产管理股份有限公司与中国科学院签署战略合作协议。考虑到当前仍处抗击新冠肺炎疫情的关键时期，此次签约通过换签形式完成。根据协议，双方将在资产经营管理、股权投资、投资基金等领域，以及科研成果应用、金融科技等方面开展深入合作。', '<p class=\"MsoNormal\" style=\"margin-top:10px;margin-bottom:0px;color:#4C4C4C;font-family:&quot;background-color:#FFFFFF;font-size:16px;text-align:justify;padding:0px;text-indent:2em;\">日前，中国长城资产管理股份有限公司与中国科学院签署战略合作协议。考虑到当前仍处抗击新冠肺炎疫情的关键时期，此次签约通过换签形式完成。根据协议，双方将在资产经营管理、股权投资、投资基金等领域，以及科研成果应用、金融科技等方面开展深入合作。</p><p class=\"MsoNormal\" style=\"margin-top:10px;margin-bottom:0px;color:#4C4C4C;font-family:&quot;background-color:#FFFFFF;font-size:16px;text-align:justify;padding:0px;text-indent:2em;\">中国科学院成立于1949年，集科研院所、学部、教育机构于一体，是中国自然科学最高学术机构、科学技术最高咨询机构、自然科学与高技术综合研究发展中心。中国科学院共拥有12个分院、100多家科研院所、3所大学（与上海市共建上海科技大学）、130多个国家级重点实验室和工程中心、270多个野外观测台站，承担20余项国家重大科技基础设施的建设与运营，正式职工7.1万余人，在学研究生6.4万余人。建院以来，中国科学院为我国科技进步、经济社会发展和国家安全做出了不可替代的重要贡献。</p>', 1, 1584945210, 3, '/uploads/admin/20200323/bc53f420b9ace8cb9c22a3419fd94122.png');
