(1, '西安中登房地产开发有限公司', NULL, NULL, NULL, NULL, 0.00, 0.00, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '付京章', '029-62220257', NULL, 'jzfu', 5, 0, 1, 1, '<p class=\"MsoNormal\" style=\"text-indent:24pt;\"><br /></p><p class=\"MsoNormal\" style=\"text-indent:0pt;margin-left:21pt;\"><span style=\"font-size:12px;\"></span><span style=\"font-size:12px;\"></span></p><p class=\"MsoNormal\" style=\"text-indent:0pt;margin-left:21pt;\"><span style=\"font-size:12px;\"><span style=\"color:#FF9900;font-family:Wingdings;font-size:16px;font-weight:700;\">☆</span><span style=\"font-family:Wingdings;font-size:16px;font-weight:700;\">&nbsp;</span></span><b><span style=\"line-height:150%;font-family:宋体;font-size:12pt;\">债权资产主要内容</span></b></p><p class=\"MsoNormal\" style=\"text-indent:24pt;\"><span style=\"line-height:150%;font-family:宋体;font-size:12pt;\"><span>截至</span>2019<span>年</span><span>5</span><span>月</span><span>31</span><span>日，西安中登房地产开发有限公司（以下简称“中登地产”）欠付我司债权本金</span><span>98638</span><span>万元，利息、罚息、违约金等以借款合同、裁定文书等法律文件为准</span><span>。债权担保方式为不动产抵押、股权质押、连带责任保证担保。</span></span><span style=\"line-height:150%;font-family:Calibri;font-size:12pt;\"></span></p><p class=\"MsoNormal\" style=\"text-indent:0pt;margin-left:21pt;\"><span style=\"font-family:Wingdings;font-size:12pt;font-weight:bold;\"><span style=\"color:#FF9900;\"><span style=\"color:#FF9900;font-family:Wingdings;font-size:16px;font-weight:700;\">☆</span></span>&nbsp;</span><b><span style=\"line-height:150%;font-family:宋体;font-size:12pt;\"><span>债务人基本情况</span></span></b><b><span style=\"line-height:150%;font-family:Calibri;font-size:12pt;\"></span></b></p><p class=\"MsoNormal\" style=\"text-indent:24pt;\"><span style=\"line-height:150%;font-family:宋体;font-size:12pt;\"><span>中登地产注册资本</span>9800<span>万元，法定代表人宋玉庆，成立于</span><span>2005</span><span>年</span><span>6</span><span>月</span><span>2</span><span>日，注册地址位于西安市未央大道</span><span>138-1</span><span>号中登大厦</span><span>26</span><span>层，经营范围为房地产开发与销售，拥有国家一级房地产开发资质，曾为陕西省龙头房地产开发企业。中登地产为中登系企业集团的核心企业，该企业集团拥有房地产建设、开发、销售、运营、物业管理等数十家关联公司。</span></span><span style=\"line-height:150%;font-family:Calibri;font-size:12pt;\"></span></p><p class=\"MsoNormal\" style=\"text-indent:0pt;margin-left:21pt;\"><span style=\"font-family:Wingdings;font-size:12pt;font-weight:bold;\"><span style=\"color:#FF9900;\"><span style=\"color:#FF9900;font-family:Wingdings;font-size:16px;font-weight:700;\">☆</span></span>&nbsp;</span><b><span style=\"line-height:150%;font-family:宋体;font-size:12pt;\"><span>担保情况</span></span></b><b><span style=\"line-height:150%;font-family:Calibri;font-size:12pt;\"></span></b></p><p class=\"MsoNormal\" style=\"text-indent:24.1pt;\"><b><span style=\"line-height:150%;font-family:宋体;font-size:12pt;\">1<span>、抵押资产</span></span></b><b><span style=\"line-height:150%;font-family:Calibri;font-size:12pt;\"></span></b></p><p class=\"MsoNormal\" style=\"text-indent:24pt;\"><span style=\"line-height:150%;font-family:宋体;font-size:12pt;\"><span>（</span>1<span>）位于安市未央大道</span><span>138-1</span><span>号中登大厦</span><span>44</span><span>套写字楼商业房产，面积合计</span><span>23113.71</span><span>平方米。目前我公司已通过法院取得其中</span><span>10</span><span>层写字楼的房屋所有权（合计</span><span>12648</span><span>平方米），可直接过户至买受人或对外租赁经营，该</span><span>10</span><span>层写字楼我公司也可单独作为物权资产出售。</span></span><span style=\"line-height:150%;font-family:Calibri;font-size:12pt;\"></span></p><p class=\"MsoNormal\" style=\"text-indent:24pt;\"><span style=\"line-height:150%;font-family:宋体;font-size:12pt;\"><span>（</span>2<span>）位于西安市凤城五路中登家园</span><span>137</span><span>套住宅房产，面积合计</span></span><span style=\"line-height:150%;font-family:Calibri;font-size:12pt;\">16914.89</span><span style=\"line-height:150%;font-family:宋体;font-size:12pt;\"><span>平方米。</span></span><span style=\"line-height:150%;font-family:Calibri;font-size:12pt;\"></span></p><p class=\"MsoNormal\" style=\"text-indent:24pt;\"><span style=\"line-height:150%;font-family:宋体;font-size:12pt;\"><span>（</span>3<span>）实际控制人之子持有的西安市丰源美佳别墅区</span><span>2</span><span>套别墅及实际控制人配偶持有的住宅</span><span>1</span><span>套。</span></span><span style=\"line-height:150%;font-family:Calibri;font-size:12pt;\"></span></p><p class=\"MsoNormal\" style=\"text-indent:24pt;\"><span style=\"line-height:150%;font-family:宋体;font-size:12pt;\"><span>（</span>4<span>）位于西安市凤城五路</span></span><span style=\"line-height:150%;font-family:Calibri;font-size:12pt;\">2366.6</span><span style=\"line-height:150%;font-family:宋体;font-size:12pt;\"><span>平米土地使用权（西经国用（</span></span><span style=\"line-height:150%;font-family:Calibri;font-size:12pt;\">2011</span><span style=\"line-height:150%;font-family:宋体;font-size:12pt;\"><span>出）第</span></span><span style=\"line-height:150%;font-family:Calibri;font-size:12pt;\">024</span><span style=\"line-height:150%;font-family:宋体;font-size:12pt;\"><span>号）。</span></span><span style=\"line-height:150%;font-family:Calibri;font-size:12pt;\"></span></p><p class=\"MsoNormal\" style=\"text-indent:24pt;\"><span style=\"line-height:150%;font-family:宋体;font-size:12pt;\"><span>（</span>5<span>）中登地产签署《抵押合同》，就其开发的“中登城市花园”项目（安置部分除外）土地及在建工程提供抵押担保。“中登城市花园”项目位于西安市未央路西侧，凤城三路与凤城四路之间，项目规划用地</span><span>113.524</span><span>亩，总建筑面积约</span><span>572864</span><span>㎡，其中村民安置房约</span><span>150000</span><span>㎡。该项目属尤家庄村城改项目，已满足土地确权条件，土地出让金补偿（一级土地整理补偿）返还比例有望达到</span><span>100%</span><span>。该项目分两期开发，一期开发已基本结束，安置房已完成回迁，商业开发住宅部分已经交房，商业开发写字楼（约</span><span>79000</span><span>㎡）及公寓大部分租户已经入驻，商业开发的商业裙楼（约</span><span>86000</span><span>㎡）已经有“京东</span><span>7FRESH</span><span>”、“瑞幸咖啡</span></span><span style=\"line-height:150%;font-family:Calibri;font-size:12pt;\">luckin coffee</span><span style=\"line-height:150%;font-family:宋体;font-size:12pt;\">”等商户开始营业。二期规划开发面积约<span>260329.6</span><span>㎡，目前已完成约</span><span>50%</span><span>建设施工量。</span></span></p><p align=\"center\" class=\"MsoNormal\" style=\"text-align:center;text-indent:21.1pt;\"><span style=\"line-height:150%;font-family:Calibri;font-size:12pt;\"></span></p><p><strong><br /></strong></p><p><strong>中登城市花园项目</strong></p><p><strong><img alt=\"\" src=\"https://cczc.snrunning.com/static/plug/kingeditor/attached/image/20190624/20190624113753_13873.png\" /><br /></strong></p><p class=\"MsoNormal\" style=\"text-indent:24pt;\"><span style=\"line-height:150%;font-family:宋体;font-size:12pt;\"><span>（</span>6<span>）中登地产签署《抵押合同》，就其开发的“中登文景时代”项目（安置部分除外）土地及在建工程提供抵押担保。“中登文景时代”项目位于西安市明光路东侧，凤城九路北侧（与地铁</span><span>4</span><span>号线凤城九路站无缝对接），项目占地</span><span>139.58</span><span>亩。该项目为全家村城中村改造项目，开发建设已经完毕，村民回迁已经完成，商业开发房产尚未销售完毕，商业开发的商业写字楼及商业裙楼正在招商中。我公司已查封该项目中尚未出租的空置商业裙楼</span><span>1-5</span><span>层，合计约</span><span>50000</span><span>平方米，该商业裙楼已通过消防验收。</span></span></p><p class=\"MsoNormal\" style=\"text-indent:24pt;\"><br /></p><b>中登文景时代项目</b><p class=\"MsoNormal\" style=\"text-indent:24.1pt;\"><b><span style=\"line-height:150%;font-family:宋体;font-size:12pt;\"></span></b></p><p style=\"font-size:12.63px;\"><b><strong><img alt=\"\" src=\"https://cczc.snrunning.com/static/plug/kingeditor/attached/image/20190624/20190624114201_16692.png\" /></strong></b></p><b><br /></b><p><br /></p><p class=\"MsoNormal\" style=\"text-indent:24.1pt;\"><b><span style=\"line-height:150%;font-family:宋体;font-size:12pt;\">2<span>、保证担保</span></span></b><b><span style=\"line-height:150%;font-family:Calibri;font-size:12pt;\"></span></b></p><p class=\"MsoNormal\" style=\"text-indent:24pt;\"><span style=\"line-height:150%;font-family:宋体;font-size:12pt;\"><span>（</span>1<span>）陕西中登实业（集团）有限公司、西安大基实业有限责任公司、西安中登德胜洋楼有限公司、陕西铭澜科技实业有限公司、西安中登油气田化学有限公司、中登地产实际控制人宋玉庆及其配偶徐秀英、中登地产股东宋宽（宋玉庆之子）为该债权提供连带责任保证担保。</span></span><span style=\"line-height:150%;font-family:Calibri;font-size:12pt;\"></span></p><p class=\"MsoNormal\" style=\"text-indent:24pt;\"><span style=\"line-height:150%;font-family:宋体;font-size:12pt;\"><span>（</span>2<span>）陕西中登投资有限公司为该债权提供连带保证担保。</span></span><span style=\"line-height:150%;font-family:Calibri;font-size:12pt;\"></span></p><p class=\"MsoNormal\" style=\"text-indent:24pt;\"><span style=\"line-height:150%;font-family:宋体;font-size:12pt;\"><span>陕西中登投资有限公司为中登浐灞苏陕金融中心项目（以下简称</span>“苏陕大厦项目”）的项目公司。苏陕大厦项目位于浐灞生态区核心区，面朝广运谭，与西安世园会遗址公园隔河相望，自然风光和人文景观较好，距离地铁<span>3</span><span>号线浐灞中心站约</span><span>800</span><span>米，距离灞柳基金小镇直线距离</span><span>1</span><span>公里，地理位置极为优越。该项目目前五证齐全（即已取得商品房预售许可证），总用地面积约</span><span>60</span><span>亩，预售证面积</span><span>25.14</span><span>万平米。项目为两栋超高层写字楼双子塔结构，地上</span><span>35</span><span>层（总高</span><span>153</span><span>米，该区域最高）、地下</span><span>2</span><span>层、裙楼</span><span>5</span><span>层，项目规划用途为顶级写字楼及五星级酒店，曾被赋予西安市浐灞生态区地标建筑使命。该项目土建主体工程已完工，外部玻璃幕墙安装已完成</span><span>70%</span><span>后，项目整体施工完成率约</span><span>80%</span><span>。根据专业人员的估算，预计后续投入</span><span>3.5</span><span>亿元即可达到使用状态，后续工期</span><span>6-8</span><span>个月。</span></span><span style=\"line-height:150%;font-family:Calibri;font-size:12pt;\"></span></p><p class=\"MsoNormal\" style=\"text-indent:24pt;\"><br /></p><p><b><b><span style=\"font-size:10.5pt;\"><b><span style=\"font-family:宋体;font-size:10.5pt;\">苏陕大厦项目现状图</span></b></span></b><br /></b></p><p><b><b><span style=\"font-family:宋体;font-size:10.5pt;\"><img alt=\"\" src=\"https://cczc.snrunning.com/static/plug/kingeditor/attached/image/20190624/20190624114721_29007.png\" /></span></b></b></p><p><b><b><span style=\"font-family:宋体;font-size:10.5pt;\"><br /></span></b></b></p><p><b><span style=\"font-family:宋体;font-size:10.5pt;\"><b><span style=\"font-family:宋体;font-size:10.5pt;\">苏陕大厦项目效果图</span></b></span></b></p><p><b><span style=\"font-family:宋体;font-size:10.5pt;\"><b><span style=\"font-family:宋体;font-size:10.5pt;\"><img alt=\"\" src=\"https://cczc.snrunning.com/static/plug/kingeditor/attached/image/20190624/20190624114740_48427.png\" /></span></b></span></b></p><p class=\"MsoNormal\" style=\"text-indent:24pt;\"><span style=\"font-family:宋体;font-size:12pt;\">（</span><span style=\"font-family:宋体;font-size:12pt;\">3</span><span style=\"font-family:宋体;font-size:12pt;\">）宁夏长登房地产开发有限公司为该债权提供连带保证担保。</span></p><p class=\"MsoNormal\" style=\"text-indent:24pt;\"><span style=\"line-height:150%;font-family:Calibri;font-size:12pt;\"></span></p><p class=\"MsoNormal\" style=\"text-indent:24pt;\"><span style=\"line-height:150%;font-family:宋体;font-size:12pt;\"><span>宁夏长登房地产开发有限公司是银川璞悦湾项目的开发主体，该项目位于宁夏银川旧城区东侧石油城范围内，银横路南侧，孔雀湖西北侧，整个项目东侧及南侧毗邻银川市孔雀湖，夏季景色优美。该项目合计占地约</span>257<span>亩，共分三期开发，其中一期（</span><span>10</span><span>栋住宅）已经全部开发销售完毕，二期地块正在建设及销售中。截至目前，三期已取得土地证但尚未开发的剩余净地约</span><span>100</span><span>亩，容积率</span><span>3.05</span><span>。</span></span></p><p><b><span style=\"font-family:宋体;font-size:10.5pt;\"><br /></span></b></p><p><b><span style=\"font-family:宋体;font-size:12pt;\">中登宁夏银川璞悦湾项目区位图</span></b></p><p><img alt=\"\" src=\"https://cczc.snrunning.com/static/plug/kingeditor/attached/image/20190624/20190624115924_83266.png\" /></p><p class=\"MsoNormal\" style=\"text-indent:24.1pt;\"><b><span style=\"line-height:150%;font-family:宋体;font-size:12pt;\">3<span>、质押担保</span></span></b><b><span style=\"line-height:150%;font-family:Calibri;font-size:12pt;\"></span></b></p><p class=\"MsoNormal\" style=\"text-indent:24pt;\"><span style=\"line-height:150%;font-family:宋体;font-size:12pt;\"><span>（</span>1<span>）宋玉庆、宋宽以其各自持有中登地产的合计</span></span><span style=\"line-height:150%;font-family:Calibri;font-size:12pt;\">100%</span><span style=\"line-height:150%;font-family:宋体;font-size:12pt;\"><span>股权为本债权提供质押担保。</span></span><span style=\"line-height:150%;font-family:Calibri;font-size:12pt;\"></span></p><p class=\"MsoNormal\" style=\"text-indent:24pt;\"><span style=\"line-height:150%;font-family:宋体;font-size:12pt;\"><span>（</span>2<span>）陕西中登实业（集团）有限公司以其持有的西安中登油气田化学有限公司</span></span><span style=\"line-height:150%;font-family:Calibri;font-size:12pt;\">51%</span><span style=\"line-height:150%;font-family:宋体;font-size:12pt;\"><span>股权为本债权提供质押担保。</span></span><span style=\"line-height:150%;font-family:Calibri;font-size:12pt;\"></span></p><p class=\"MsoNormal\" style=\"text-indent:24.1pt;\"><b><span style=\"line-height:150%;font-family:宋体;font-size:12pt;\">4<span>、其他可控资产</span></span></b><span style=\"line-height:150%;font-family:宋体;font-size:12pt;\"><span>。</span></span><b><span style=\"line-height:150%;font-family:Calibri;font-size:12pt;\"></span></b></p><p class=\"MsoNormal\" style=\"text-indent:24pt;\"><span style=\"line-height:150%;font-family:宋体;font-size:12pt;\"><span>（</span>1<span>）中登地产承诺由我公司主导“中登湖景花园项目”的项目重组。中登湖景花园项目为城中村改造项目，该项目位于西安市未央湖西北侧，地处西安市未央区未央湖风景区阳光大道与湖滨西路十字西北角，与长庆湖滨花园相邻。目前安置房已经封顶，约</span><span>90</span><span>亩开发用地基本为空置状态，剩余可开发面积约</span><span>186000</span><span>平方米。</span></span><span style=\"line-height:150%;font-family:Calibri;font-size:12pt;\"></span></p><p class=\"MsoNormal\" style=\"text-indent:21.1pt;\"><span style=\"font-family:宋体;font-size:10.5pt;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span></p><b><b><span style=\"font-family:宋体;font-size:10.5pt;\"><b>中登湖景花园项目现状图</b><br /></span></b></b><b><img alt=\"\" src=\"https://cczc.snrunning.com/static/plug/kingeditor/attached/image/20190624/20190624114935_50252.png\" /><br /></b><p><br /></p><p class=\"MsoNormal\" style=\"text-indent:21.1pt;\"><b><span style=\"font-family:宋体;font-size:10.5pt;\"><span></span></span></b></p><p class=\"MsoNormal\" style=\"text-indent:21.1pt;font-size:12.63px;\"><b><br /></b></p><p class=\"MsoNormal\" style=\"text-indent:21.1pt;font-size:12.63px;\"><b></b></p><p><b><b>中登湖景花园项目效果图</b></b></p><p><b><b><b><span style=\"font-family:宋体;font-size:10.5pt;\"><img alt=\"\" src=\"https://cczc.snrunning.com/static/plug/kingeditor/attached/image/20190624/20190624115005_24181.png\" /></span></b></b></b></p><p><b><b><br /></b></b></p><p><br /></p><p class=\"MsoNormal\" style=\"text-indent:18pt;\"><span style=\"line-height:150%;font-family:宋体;font-size:12pt;\"><span>（</span>2<span>）中登地产其他财产权益。中登地产及其关联企业在陕西省内有较多房地产项目的前期土地储备，诸如与融创地产合作的十里铺城中村改造项目、泾河工业园土地储备项目、泾阳房地产开发项目、渭南白水房地产开发项目等均有望为不良资产投资者产生现金回报。</span></span></p><p class=\"MsoNormal\" style=\"text-indent:0pt;margin-left:21pt;\"><span style=\"font-family:Wingdings;font-size:12pt;font-weight:bold;\"><span style=\"color:#FF9900;\"><span style=\"color:#FF9900;font-family:Wingdings;font-size:16px;font-weight:700;\">☆</span></span>&nbsp;</span><b><span style=\"line-height:150%;font-family:宋体;font-size:12pt;\"><span>诉讼执行情况</span></span></b><b><span style=\"line-height:150%;font-family:Calibri;font-size:12pt;\"></span></b></p><p class=\"MsoNormal\" style=\"text-indent:24pt;\"><span style=\"line-height:150%;font-family:宋体;font-size:12pt;\"><span>我公司于</span>2016<span>年</span><span>4</span><span>月取得法院执行裁定。截至目前，累计查封各被执行人名下土地使用权</span><span>7</span><span>宗（</span><span>1</span><span>宗已拍卖），房产</span><span>228</span><span>套（</span><span>71</span><span>套已拍卖），五证齐全在建工程</span><span>219950</span><span>平方米，其他在建工程</span><span>51613.6</span><span>平方米，被执行人关联公司的股权</span><span>22</span><span>家，对中登地产实际控制人宋玉庆及其配偶徐秀英、其子宋宽采取了限制出境的措施，所有诉讼执行措施均在正常进行。</span></span><span style=\"line-height:150%;font-family:Calibri;font-size:12pt;\"></span></p><p class=\"MsoNormal\" style=\"text-indent:0pt;margin-left:21pt;\"><span style=\"font-family:Wingdings;font-size:12pt;font-weight:bold;\"><span style=\"color:#FF9900;\"><span style=\"color:#FF9900;font-family:Wingdings;font-size:16px;font-weight:700;\">☆</span></span>&nbsp;</span><b><span style=\"line-height:150%;font-family:宋体;font-size:12pt;\"><span>项目亮点</span></span></b><b><span style=\"line-height:150%;font-family:Calibri;font-size:12pt;\"></span></b></p><p class=\"MsoNormal\" style=\"text-indent:24pt;\"><span style=\"line-height:150%;font-family:宋体;font-size:12pt;\">1<span>、中登地产及其关联方控制下的潜在优质资产较多，且在区位、价格等方面优势明显，经投资人优化后升值空间巨大。</span></span><span style=\"line-height:150%;font-family:Calibri;font-size:12pt;\"></span></p><p class=\"MsoNormal\" style=\"text-indent:24pt;\"><span style=\"line-height:150%;font-family:宋体;font-size:12pt;\">2<span>、我公司为中登系的最大债权人，控制资产最多、司法查封时间最早、对企业真实情况的掌握最为全面，对中登系的整体债务解决及资产重组具有主导作用。</span></span><span style=\"line-height:150%;font-family:Calibri;font-size:12pt;\"></span></p><p class=\"MsoNormal\" style=\"text-indent:24pt;\"><span style=\"line-height:150%;font-family:宋体;font-size:12pt;\">3<span>、债权合作方式多样，我公司可接受债权转让、资产重组等多种合作方式。对于资产重组，我公司已为相关资产设计了多种差异化重组思路，重组思路均已与律师事务所、会计师事务所等机构进行可行性研讨，可满足各类投资人的不同需求，合作方式多样，合作空间巨大。</span></span><span style=\"line-height:150%;font-family:Calibri;font-size:12pt;\"></span></p><p><br /></p><p><br /></p><p class=\"MsoNormal\" style=\"text-indent:21pt;\"><span style=\"line-height:2.5;\"></span></p>', '/uploads/admin/20190605/4350d3df0d847c4119cad6d4d41c9f5f.png', 0, NULL, 1),
(3, '陕西中泰集团有限公司', NULL, NULL, NULL, NULL, 0.00, 0.00, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '白璐', '029-62220235', NULL, 'bailu', 3, 0, 1, 1, '<p class=\"MsoNormal\" style=\"text-indent:30pt;\"><span><br /></span></p><p class=\"MsoNormal\" style=\"text-indent:30pt;\"><span style=\"line-height:2.5;\">截止</span><span style=\"line-height:2.5;\">2019</span><span style=\"line-height:2.5;\">年</span><span style=\"line-height:2.5;\">3</span><span style=\"line-height:2.5;\">月</span><span style=\"line-height:2.5;\">31</span><span style=\"line-height:2.5;\">日，债权本金余额</span><span style=\"line-height:2.5;\">11320.51</span><span style=\"line-height:2.5;\">万元，利息余额</span><span style=\"line-height:2.5;\">5322.51</span><span style=\"line-height:2.5;\">万元，复利、罚息、违约金等具体计算以协议约定、法律规定以及相关法律文书认定为准。</span></p><p class=\"MsoNormal\" style=\"text-indent:30pt;\"><span><br /></span></p><p class=\"MsoNormal\" style=\"text-indent:30pt;\"><span></span></p><hr /><br /><p><br /></p><p class=\"MsoNormal\" style=\"text-indent:30pt;\"><span style=\"font-size:16px;\"><strong><span style=\"color:#337FE5;line-height:2.5;\">★</span><span style=\"line-height:2.5;\"> 抵押担保</span></strong></span></p><p class=\"MsoNormal\" style=\"text-indent:30pt;\"><span style=\"line-height:2.5;\">中泰集团以其持有的办公楼、车库及机械设备等提供抵押担保；</span></p><p class=\"MsoNormal\" style=\"text-indent:30pt;\"><span style=\"line-height:2.5;\">陕西省天台山矿业开发有限责任公司以其自有房屋、机器设备、在建工程，和天台山采矿权提供抵押担保。</span></p><p class=\"MsoNormal\" style=\"text-indent:30pt;\"><span style=\"font-size:16px;\"><strong><span style=\"color:#337FE5;line-height:2.5;\">★</span><span style=\"line-height:2.5;\"> 权利质押</span></strong></span></p><p class=\"MsoNormal\" style=\"text-indent:30pt;\"><span style=\"line-height:2.5;\">徐保明、何新霞、徐鹏以其持有中泰集团</span><span style=\"line-height:2.5;\">100%</span><span style=\"line-height:2.5;\">股权、天台山矿业</span><span style=\"line-height:2.5;\">100%</span><span style=\"line-height:2.5;\">股权提供质押担保。</span></p><p class=\"MsoNormal\" style=\"text-indent:30p