(1226, '陕西中赢置业集团有限公司（待修改）', '49', '130', NULL, '175', 14500.00, 19919.71, '抵押+质押+保证', '贺宏葳、彭红梅', '4', '20', '49', '130', '16723.96平米', '陕西中赢置业集团有限公司', '张玮', '029-62220285', '', '', 0, 0, 1, 1, '<span> </span><p class=\"MsoNormal\" style=\"text-indent:30pt;\"><span style=\"font-family:仿宋;font-size:15pt;\">中赢置业投资兴建的中赢文化广场是</span><span style=\"font-size:15pt;\"><span>2010</span></span><span style=\"font-family:仿宋;font-size:15pt;\">年市政府招商引资重点建设项目，总投资</span><span style=\"font-size:15pt;\"><span>5</span></span><span style=\"font-family:仿宋;font-size:15pt;\">亿人民币，建筑面积</span><span style=\"font-size:15pt;\"><span>6</span></span><span style=\"font-family:仿宋;font-size:15pt;\">万平米（不含财神庙部分），于</span><span style=\"font-size:15pt;\"><span>2014</span></span><span style=\"font-family:仿宋;font-size:15pt;\">年建成并投入运营，于</span><span style=\"font-size:15pt;\"><span>2015</span></span><span style=\"font-family:仿宋;font-size:15pt;\">年被陕西省文化厅评为“陕西省文化产业示范基地”，项目五证齐全。该项目由国内著名建筑设计师张锦秋规划设计，地处于榆林最繁华的第一大商圈的新建北路上，东接榆林老街，西邻新建北路，北邻老城墙，南邻新建南路。作为榆林二街商圈内独具特色的商业综合体，以及榆林古城北端标志性商业建筑，资源稀缺性和未来升值潜力较高。现场及区位图如下：</span></p><p class=\"MsoNormal\" style=\"text-indent:30pt;\"><span style=\"font-family:仿宋;font-size:15pt;\"><img width=\"1078\" height=\"1047\" style=\"width:306px;height:278px;\" alt=\"\" src=\"/static/plug/kingeditor/php/../attached/image/20190620/20190620150523_52729.png\" /><img width=\"1022\" height=\"288\" style=\"width:734px;height:224px;\" alt=\"\" src=\"/static/plug/kingeditor/php/../attached/image/20190620/20190620150523_34052.jpg\" /></span></p><span> </span>', '', 1, '1、债权风控措施较强\n一是抵押率较低。中赢文化广场16723.96平米商业房产，以及望湖星城20192.33平米在建工程，评估价值合计为38064.15万元，初始抵押率低于40%。二是抵押资产质量较好。中赢文化广场为已建成的商业，已办理了房产证，资产区位优势较为突出，加之诉讼执行已进入执行阶段，未来不需要大额资金投入。\n2、抵押物分布较为集中\n抵押的中赢文化广场27套面积16723.96平米商业房产全部集中在靠近新建北路的主要商业区（B区和C区），其中一层面积1529平米（10户），分布在B区和C区；二层面积1240平米（1户），集中在C区；三层面积6224平米（9户），占B区和C区整层92.3%；四层面积3541平米（4户），含B区整层和C区部分；五层面积2946平米（2户），为B区整层；六层面积1241.86平米（1户），为B区整层。\n3、司法裁定以资抵债价格低于市场价格\n目前抵押物已具备裁定以资抵债的条件，且以资抵债价格较低，一层单价2.94万元/平米、二层单价1.62万元/平米、三层单价1.31万元/平米、四层单价0.85万元/平米、五层和六层单价0.68万元/平米。购买债权实施以资抵债，未来有一定的运作升值空间。\n4、债权有重组运作空间\n总体上看，对中赢系实施债务重组具备一定的基础，主要表现在以下三方面：\n（1）各方较为支持。中赢置业实际控制人贺宏葳有解决债务的迫切愿望，提供了多处资产参与重组（见后文）；政府对解决中赢系债务表示出了责任担当，愿意以中赢置业项目为案例，探索解决地方社会问题的新路径；各家银行受困于项目复杂情况，长期执行未果，有化解不良风险的迫切需求。\n（2）资产相对足值。中赢置业主要资产共7部分价值约15.5亿元（包括关联公司资产），负债涉及7家金融机构和多个自然人约10.58亿元（包括关联公司负债）。如不考虑利息因素，资产与债务的价值差额较为充裕，具备一定的重组基础。\n \n（3）资产质量较好。拟重组资产质量较好，为房产或土地等不动产，尤其是中赢文化广场、人民浴池、塞上饭庄、飒企办公楼、飒企住宅等房产均为有证资产，不需继续投入资金建设，重组后可直接转为经营性物业或快速处置变现。此外，榆林经济已出现回暖迹象，上述资产区位优势较为明显，未来有一定的升值空间。', 0),
(1227, '陕西中赢置业集团有限公司（待修改）', '49', '130', NULL, '175', 14500.00, 19919.71, '抵押+质押+保证', '贺宏葳、彭红梅', '10', '39', '49', '130', '20192.33平米', '陕西中赢置业集团有限公司', '张玮', '029-62220285', '', '', 0, 0, 1, 1, '<p><span style=\"font-family:仿宋;font-size:15pt;\">望湖星城是中赢置业在榆林市东沙区开发的一个集居住和商业于一体的综合住宅小区。该项目总占地</span><span style=\"font-family:&quot;font-size:15pt;\">48</span><span style=\"font-family:仿宋;font-size:15pt;\">亩，规划总建筑面积</span><span style=\"font-family:&quot;font-size:15pt;\">9</span><span style=\"font-family:仿宋;font-size:15pt;\">万多平方米，项目五证齐全。抵押在建工程为望湖星城西区3层底商及其地下车位。现场及区位图如下：</span></p><p><span style=\"font-family:仿宋;font-size:15pt;\"><img width=\"1074\" height=\"1078\" style=\"width:300px;height:310px;\" alt=\"\" src=\"/static/plug/kingeditor/php/../attached/image/20190620/20190620150812_33447.png\" /><embed src=\"https://v.youku.com/v_show/id_XNDExNDI3MTkyNA==.html?refer=seo_operation.liuxiao.liux_00003303_3000_Qzu6ve_19042900\" type=\"video/x-ms-asf-plugin\" width=\"550\" height=\"400\" autostart=\"false\" loop=\"true\" /></span></p>', '', 1, '1、债权风控措施较强\n一是抵押率较低。中赢文化广场16723.96平米商业房产，以及望湖星城20192.33平米在建工程，评估价值合计为38064.15万元，初始抵押率低于40%。二是抵押资产质量较好。中赢文化广场为已建成的商业，已办理了房产证，资产区位优势较为突出，加之诉讼执行已进入执行阶段，未来不需要大额资金投入。\n2、抵押物分布较为集中\n抵押的中赢文化广场27套面积16723.96平米商业房产全部集中在靠近新建北路的主要商业区（B区和C区），其中一层面积1529平米（10户），分布在B区和C区；二层面积1240平米（1户），集中在C区；三层面积6224平米（9户），占B区和C区整层92.3%；四层面积3541平米（4户），含B区整层和C区部分；五层面积2946平米（2户），为B区整层；六层面积1241.86平米（1户），为B区整层。\n3、司法裁定以资抵债价格低于市场价格\n目前抵押物已具备裁定以资抵债的条件，且以资抵债价格较低，一层单价2.94万元/平米、二层单价1.62万元/平米、三层单价1.31万元/平米、四层单价0.85万元/平米、五层和六层单价0.68万元/平米。购买债权实施以资抵债，未来有一定的运作升值空间。\n4、债权有重组运作空间\n总体上看，对中赢系实施债务重组具备一定的基础，主要表现在以下三方面：\n（1）各方较为支持。中赢置业实际控制人贺宏葳有解决债务的迫切愿望，提供了多处资产参与重组（见后文）；政府对解决中赢系债务表示出了责任担当，愿意以中赢置业项目为案例，探索解决地方社会问题的新路径；各家银行受困于项目复杂情况，长期执行未果，有化解不良风险的迫切需求。\n（2）资产相对足值。中赢置业主要资产共7部分价值约15.5亿元（包括关联公司资产），负债涉及7家金融机构和多个自然人约10.58亿元（包括关联公司负债）。如不考虑利息因素，资产与债务的价值差额较为充裕，具备一定的重组基础。\n \n（3）资产质量较好。拟重组资产质量较好，为房产或土地等不动产，尤其是中赢文化广场、人民浴池、塞上饭庄、飒企办公楼、飒企住宅等房产均为有证资产，不需继续投入资金建设，重组后可直接转为经营性物业或快速处置变现。此外，榆林经济已出现回暖迹象，上述资产区位优势较为明显，未来有一定的升值空间。', 0),
