(1230, '陕西中赢置业集团有限公司', NULL, NULL, NULL, NULL, 0.00, 0.00, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '张玮', '029-62220285', NULL, 'zhangwei', 6, 0, 1, 1, '<p style=\"text-align:left;text-indent:2em;font-size:12px;\"><span style=\"font-family:SimSun;font-size:16px;\"><span style=\"font-family:SimSun;font-size:16px;\">截止</span></span><span style=\"font-family:SimSun;font-size:16px;\">2019</span><span style=\"font-family:SimSun;font-size:16px;\">年</span><span style=\"font-family:SimSun;font-size:16px;\">3</span><span style=\"font-family:SimSun;font-size:16px;\">月</span><span style=\"font-family:SimSun;font-size:16px;\">31</span><span style=\"font-family:SimSun;font-size:16px;\">日，债权本金余额</span><span style=\"font-family:SimSun;font-size:16px;\">14500.00</span><span style=\"font-family:SimSun;font-size:16px;\">万元，利息余额</span><span style=\"font-family:SimSun;font-size:16px;\">1374.12</span><span style=\"font-family:SimSun;font-size:16px;\">万元，复利、罚息、违约金等具体计算以协议约定、法律规定以及相关法律文书认定为准。</span></p><p style=\"text-align:left;text-indent:2em;font-size:12px;\"><span style=\"font-family:SimSun;font-size:16px;\"><span style=\"color:#FF9900;\">☆</span></span><span style=\"font-family:SimSun;font-size:16px;\">抵押担保</span><span style=\"font-family:SimSun;font-size:16px;\">&nbsp; &nbsp; &nbsp;</span></p><p style=\"text-align:left;text-indent:2em;font-size:12px;\"><span><span style=\"font-family:SimSun;font-size:16px;\">中赢文化商业广场</span><span style=\"font-family:SimSun;font-size:16px;\">16723.96</span><span style=\"font-family:SimSun;font-size:16px;\">平方米（</span><span style=\"font-family:SimSun;font-size:16px;\">27</span><span style=\"font-family:SimSun;font-size:16px;\">套）的商业地产；</span></span></p><p style=\"text-align:left;text-indent:2em;font-size:12px;\"><span><span style=\"font-family:SimSun;font-size:16px;\"><span style=\"font-family:SimSun;font-size:16px;\">望湖星城西区</span><span style=\"font-family:SimSun;font-size:16px;\">1</span><span style=\"font-family:SimSun;font-size:16px;\">号楼</span><span style=\"font-family:SimSun;font-size:16px;\">4576.56</span><span style=\"font-family:SimSun;font-size:16px;\">平方米商铺和</span><span style=\"font-family:SimSun;font-size:16px;\">15615.77</span><span style=\"font-family:SimSun;font-size:16px;\">平方米地下室（</span><span style=\"font-family:SimSun;font-size:16px;\">300</span><span style=\"font-family:SimSun;font-size:16px;\">车位）的在建工程提供抵押担保。</span></span></span></p><p style=\"text-align:left;text-indent:2em;font-size:12px;\"><span style=\"color:#FF9900;font-family:SimSun;font-size:16px;\">☆</span><span style=\"font-family:SimSun;font-size:16px;\">质押担保</span></p><p style=\"text-indent:2em;font-size:12.63px;\"><span style=\"font-size:16px;\">中赢置业</span><span style=\"font-size:16px;\">100%</span><span style=\"font-size:16px;\">股权</span></p><p style=\"text-indent:2em;font-size:12px;\"><span style=\"font-family:仿宋;font-size:15pt;\"><span style=\"color:#FF9900;font-family:SimSun;font-size:16px;\">☆</span><span style=\"font-family:SimSun;font-size:16px;\"></span></span><span style=\"font-family:SimSun;font-size:16px;\">保证担保</span></p><p style=\"text-indent:2em;font-size:12.63px;\"><span style=\"font-family:SimSun;font-size:16px;\">中赢置业实际控制人贺宏葳及其配偶彭红梅。</span></p><p style=\"text-indent:2em;font-size:12.63px;\"><span style=\"color:#FF9900;font-family:SimSun;font-size:16px;\">☆</span><span style=\"font-family:SimSun;font-size:16px;\">资产亮点</span></p><p style=\"text-indent:2em;font-size:12px;\"><span style=\"font-family:仿宋;font-size:15pt;\"><span style=\"font-family:SimSun;font-size:16px;\">1、债权风控</span><span style=\"font-family:SimSun;font-size:16px;\"></span><span style=\"font-family:SimSun;font-size:16px;\">措施较强</span></span></p><p style=\"text-indent:2em;font-size:12px;\"><span style=\"font-family:仿宋;font-size:15pt;\"><span style=\"font-family:SimSun;font-size:16px;\"></span><span style=\"font-family:SimSun;font-size:16px;\">一是抵押率较低。中赢文化广场16723.96平米商业房产，以及望湖星城20192.33平米在建工程</span><span style=\"font-family:SimSun;\"></span><span style=\"font-family:SimSun;font-size:16px;\">，评估价值合计为38064.15万元，初始抵押率低于40%。</span></span></p><p style=\"text-indent:2em;font-size:12px;\"><span style=\"font-family:仿宋;font-size:15pt;\"><span style=\"font-family:SimSun;font-size:16px;\">二是抵押资产质量较好。中赢文化广场为已建成的商业，已办理了房产证，资产区位优势较为突出，加之诉讼执行已进入执行阶段，未来不需要大额资金投入。</span></span></p><p style=\"text-indent:2em;font-size:12px;\"><span style=\"font-family:仿宋;font-size:15pt;\"><span style=\"font-family:SimSun;font-size:16px;\"></span><span style=\"font-family:SimSun;font-size:16px;\">2、抵押物分布较为集中</span></span></p><p style=\"text-indent:2em;font-size:12px;\"><span style=\"font-family:仿宋;font-size:15pt;\"><span style=\"font-family:SimSun;font-size:16px;\"></span><span style=\"font-family:SimSun;font-size:16px;\">抵押的中赢文化广场27套面积16723.96平米商业房产全部集中在靠近新建北路的主要商业区（B区和C区），其中一层面积1529平米（10户），分布在B区和C区；二层面积1240平米（1户），集中在C区；三层面积6224平米（9户），占B区和C区整层92.3%；四层面积3541平米（4户），含B区整层和C区部分；五层面积2946平米（2户），为B区整层；六层面积1241.86平米（1户），为B区整层。</span></span></p><p style=\"text-indent:2em;font-size:12px;\"><span style=\"font-family:仿宋;font-size:15pt;\"><span style=\"font-family:SimSun;font-size:16px;\"></span><span style=\"font-family:SimSun;font-size:16px;\">3、司法裁定以资抵债价格低于市场价格</span></span></p><p style=\"text-indent:2em;font-size:12px;\"><span style=\"font-family:仿宋;font-size:15pt;\"><span style=\"font-family:SimSun;font-size:16px;\"></span><span style=\"font-family:SimSun;font-size:16px;\">目前抵押物已具备裁定以资抵债的条件，且以资抵债价格较低，一层单价2.94万元/平米、二层单价1.62万元/平米、三层单价1.31万元/平米、四层单价0.85万元/平米、五层和六层单价0.68万元/平米。购买债权实施以资抵债，未来有一定的运作升值空间。</span></span></p><p style=\"text-indent:2em;font-size:12px;\"><span style=\"font-family:仿宋;font-size:15pt;\"><span style=\"font-family:SimSun;font-size:16px;\"></span></span><span style=\"font-family:SimSun;font-size:16px;\"><span style=\"color:#FF9900;\"><strong>☆</strong><span>抵押物1介绍：</span></span>中赢置业投资兴建的中赢文化广场是</span><span style=\"font-family:SimSun;font-size:16px;\">2010</span><span style=\"font-family:SimSun;font-size:16px;\">年市政府招商引资重点建设项目，总投资</span><span style=\"font-family:SimSun;font-size:16px;\">5</span><span style=\"font-family:SimSun;font-size:16px;\">亿人民币，建筑面积</span><span style=\"font-family:SimSun;font-size:16px;\">6</span><span style=\"font-family:SimSun;font-size:16px;\">万平米（不含财神庙部分），于</span><span style=\"font-family:SimSun;font-size:16px;\">2014</span><span style=\"font-family:SimSun;font-size:16px;\">年建成并投入运营，于</span><span style=\"font-family:SimSun;font-size:16px;\">2015</span><span style=\"font-family:SimSun;font-size:16px;\">年被陕西省文化厅评为“陕西省文化产业示范基地”，项目五证齐全。该项目由国内著名建筑设计师张锦秋规划设计，地处于榆林最繁华的第一大商圈的新建北路上，东接榆林老街，西邻新建北路，北邻老城墙，南邻新建南路。作为榆林二街商圈内独具特色的商业综合体，以及榆林古城北端标志性商业建筑，资源稀缺性和未来升值潜力较高。现场及区位图如下：</span></p><span style=\"font-family:SimSun;font-size:16px;\"></span><p style=\"text-indent:2em;font-size:12px;\"><span style=\"font-family:仿宋;font-size:15pt;\"><span style=\"font-family:SimSun;font-size:16px;\"><img width=\"1078\" height=\"1047\" style=\"width:306px;height:278px;\" alt=\"\" src=\"https://cczc.snrunning.com/static/plug/kingeditor/attached/image/20190620/20190620150523_52729.png\" /><br /></span></span><span style=\"font-family:仿宋;font-size:15pt;\"><span style=\"font-family:SimSun;font-size:16px;\"><img width=\"1022\" height=\"288\" style=\"width:734px;height:224px;\" alt=\"\" src=\"https://cczc.snrunning.com/static/plug/kingeditor/attached/image/20190620/20190620150523_34052.jpg\" /></span></span><span style=\"font-family:仿宋;font-size:15pt;\"><span style=\"font-family:SimSun;font-size:16px;\"><span style=\"color:#FF9900;\"><strong></strong></span></span></span></p><p style=\"text-indent:2em;font-size:12px;\"><span style=\"font-family:仿宋;font-size:15pt;\"><span style=\"font-family:SimSun;font-size:16px;\"><span style=\"color:#FF9900;\"><strong>☆</strong><span>抵押物2介绍：</span></span>望湖星城是中赢置业在榆林市东沙区开发的一个集居住和商业于一体的综合住宅小区。该项目总占地48亩，规划总建筑面积9万多平方米，项目五证齐全。抵押在建工程为望湖星城西区3层底商及其地下车位。现场及区位图如下：<br /></span></span><span style=\"font-family:仿宋;font-size:15pt;\"><span style=\"font-family:SimSun;font-size:16px;\"><img width=\"1074\" height=\"1078\" style=\"width:300px;height:310px;\" alt=\"\" src=\"https://cczc.snrunning.com/static/plug/kingeditor/attached/image/20190620/20190620150812_33447.png\" /><img width=\"1021\" height=\"483\" style=\"width:589px;height:320px;\" alt=\"\" src=\"/static/plug/kingeditor/attached/image/20190910/20190910143226_39614.jpg\" /></span></span></p>', '/uploads/admin/20190624/a15ea39a11a67488d964d55ca77326dc.png', 0, NULL, 1),
