,x_0,y_383,w_640,h_406\" style=\"vertical-align:middle;max-width:100%;width:100%;box-sizing:border-box;\" /></section></section></section><section style=\"position:static;box-sizing:border-box;\"><section style=\"text-align:center;position:static;box-sizing:border-box;\"><section style=\"display:inline-block;vertical-align:middle;box-sizing:border-box;\"><section style=\"box-sizing:border-box;\"><section style=\"display:inline-block;vertical-align:top;box-sizing:border-box;\"><p style=\"margin-top:0px;margin-bottom:0px;padding:0px;box-sizing:border-box;\"><strong>活动规则</strong></p></section></section></section></section></section><section style=\"position:static;box-sizing:border-box;\"><section style=\"margin-top:10px;margin-bottom:10px;text-align:center;position:static;box-sizing:border-box;\"><section style=\"display:inline-block;width:95%;box-sizing:border-box;\"><section style=\"position:static;box-sizing:border-box;\"><section style=\"position:static;box-sizing:border-box;\"><section style=\"display:inline-block;width:100%;vertical-align:top;box-sizing:border-box;\"><section style=\"position:static;box-sizing:border-box;\"><section style=\"transform:translate3d(0px, 0px, 0px);-webkit-transform:translate3d(0px, 0px, 0px);-moz-transform:translate3d(0px, 0px, 0px);-o-transform:translate3d(0px, 0px, 0px);position:static;box-sizing:border-box;\"><section style=\"display:inline-block;width:100%;height:240px;vertical-align:top;box-sizing:border-box;\"><section style=\"box-sizing:border-box;\"><section style=\"position:static;box-sizing:border-box;\"><section style=\"position:static;box-sizing:border-box;\"><section style=\"display:inline-block;width:100%;vertical-align:top;box-sizing:border-box;\"><section style=\"box-sizing:border-box;\"><section style=\"position:static;box-sizing:border-box;\"><section style=\"text-align:justify;box-sizing:border-box;\"><p style=\"margin-top:0px;margin-bottom:0px;padding:0px;box-sizing:border-box;\"><span style=\"font-size:14px;\">1