INSERT INTO `changcheng_content_article` (`content_id`, `content`) VALUES
(133, '&nbsp; &nbsp; &nbsp; 闲来无事，常常流连于浩渺如宇宙的网络世界去浏览赏读那些文学大家或者是妙手之笔用心倾注的“真迹墨宝”。也许是因为懒，自觉得，如今这样的浏览阅读方式远胜于翻看纸质图书的经济了。启动电脑，打开浏览器，便如同走进一家无边无际的世界级的图书馆：文豪名家、古今中外、天文地理、经史子集、人文历史、奇趣轶闻等等等等，无所不包、无所不有，与此，十万分地感慨当代科学技术的发达，网络的奇妙与神速，为广大为文而用心者，为我这区区一小卒打开并提供了一条如此便利又实惠的轻捷之途。<br />\n&emsp;&emsp;<br />\n&emsp;&emsp;我之所以将那些流传至今的，盛行于互联网的，或者德才兼备的文字称之为“真迹墨宝”是因为我在搜肠刮肚之余实在找不出更恰当的词语去形容他们作品的美好。在我的眼里，那是从写作者的心里手下自然流淌出来的一泓泓山泉清流，是盛开在我们精神世界里的灵魂之花，那里的每一笔，每一字，每一句都饱含着他们极其认真仔细执着负责的态度。在那里，他们为之耗费了多少的精力精神与时间，其中饱蘸着他们多少的智慧和灵魂之光，多少的社会责任与担当的文化贡献，使我深感汗流浃背的而变得肃然起敬起来。<br />\n&emsp;&emsp;<br />\n&emsp;&emsp;我之所以将那些伟大的作品，那些被众人奉为圭臬的，那些被点赞推荐的优美文字称之为“真迹墨宝”，还因为是——在这样的文字里你绝对看不见或找不到一星点儿的抄袭剽窃的迹像。旁引博证也好，借古喻今也罢，自成一体的文字，似诙谐、似幽默，或平铺直叙、或侃侃而谈，无论是山高或是水长都是那么真切地跳动着他/她生命的脉搏，凝聚着他/她岁月给与的痕迹和深深的文化修练与文字功力。在这样认真严谨的文字里，每一个标点每一个符号都是那么认真地运用到了恰到好处，那都是我远远不能企及的，是我自觉得“可远观而不可亵玩”的杰作，其中，不乏有名不经传，默默无闻的作者和写手们的作品，它仿如“昭昭若日月之明，离离如星辰之行”，使我由衷地生出深切的敬仰而拜为至高的榜样。<br />\n&emsp;&emsp;<br />\n&emsp;&emsp;时至今日，与他们，我从无谋一面之幸，更不消说什么言语的深入交流或沟通，无论是已故的先生们，还是仍健在于世前辈，乃至于仍隐没在莽莽文海，辛勤劳作，鲜为人知的作家，他们的作品，他们的文字之所以让我欣赏，之所以让我迷醉，还因为是它展现在我眼前的，闪耀在字里行间的无形若有影的人格魅力。<br />\n&emsp;&emsp;<br />\n&emsp;&emsp;人格是什么，怎么样的人格才无愧于这样的魅力？<br />\n&emsp;&emsp;<br />\n&emsp;&emsp;且不例举说远古或海外的文学大家们，也暂且不提中国当代名家文人，我仅以当下“草根”之著为例——余秀华，一个“摇摇晃晃”地走在“摇摇晃晃”的人生之路上的残疾作者。范素雨，一个被“命运装订得拙劣不堪”的生命写手，面对岁月给与的苦难，凭其悠如处之的幽默，顽强的精神，坚韧的毅力写就出生命的断章。她们只凭着一手对自己负责，一手对他人的真诚，一心为平凡的世界而努力的态度，为我们奉上了一笔充满真情实意的，实则是难能可贵的范例······<br />\n&emsp;&emsp;<br />\n&emsp;&emsp;大凡读过《我是范素雨》，有谁不被她的平凡而朴实的思想所撼动？用心体会一下余秀华坎坷的心路历程，去读出自于她手下的文学作品，有谁不被其耀眼的魅力所深深折服？她们是真诚的，这样的真诚使她们从来没有想过会“一鸣惊人”，从来没想到这样的认真会有这样的“有朝一日”。究其根源，全在于她们以一颗平常普通的心一直奉行着无愧我心的人生哲学。<br />\n&emsp;&emsp;<br />\n&emsp;&emsp;中华文字，自从她诞辰之日起并无粗鄙优劣之分，时至今日，之所以有某些“恶臭之气”窜于其中，只因为如此美好的文字落在了某些肮脏不堪之手，被他们肆意侵滥着。<br />\n&emsp;&emsp;<br />\n&emsp;&emsp;移花接木，去头截尾，生搬硬套，东拼西凑，似剽窃，或抄袭，更有甚者，干脆撇去原创作者的笔名或名字，冠以自己之作来一个“照单全收”。是为趋利，或为别有用心？这真如欧阳修先生所云：“不知耻者，无所不为”！面对浩若星辰的网络世界，我无从追根溯源探其目的究竟如何，却从中可以看到，这种无异于强取豪夺的无良行为损害的不仅仅是为文之道，丧失着做人的最基本的品德，此举，更是深深地伤害着、羞辱着在文学路上辛勤耕耘着的每一位作者和写手们的尊严，更是对当下网络文学能否走在健康发展路上之状态的漠然与亵渎。<br />\n&emsp;&emsp;<br />\n&emsp;&emsp;忆当年，受经济条件的限制，有我的同学为完整地抄录一部爱不释手的“名著”废寝忘食般地埋首于微弱的手电筒下，为求证谁才是那一部手抄本的真正作者，几乎耗尽他本可以尽情玩耍的大半个暑假时间。如此“幼稚”的行为在网络文学高度发达的今天看来是否意味着它是多么的愚蠢而可笑呢？<br />\n&emsp;&emsp;<br />\n&emsp;&emsp;既不为名亦不为利，只为真正的文学；只为尊重原著；只为尊重其付出的不易，何况还冒着被捡举揭发的可能挨全校批斗的危险！<br />\n&emsp;&emsp;<br />\n&emsp;&emsp;电脑的普及，网络的自由为我们洞开一个全新的世界，也为那些无良之人提供了一个极为便利的投机取巧的条件。也许，我们谁都无力也无法去扭转这种令人痛心的状态，所以只能眼睁睁地看着那些成篇成章的优秀作品被无德之“士”任意的盗挖，肆意地践踏，也因此，为保全自己的“孩子”不再被任意的侵略，有诸多的写作者们不得不心如滴血般地呐喊出诸如“尊重原创，远离抄袭”一类的无奈之声······<br />\n&emsp;&emsp;<br />\n&emsp;&emsp;其实，你如果想成为一名作家真的很难，其中的难不是靠掠取他人的辛劳成果就可以克服，何况，奋泳在茫茫文海中的写作者早已多如过江之鲫，数不胜数。想成为一名作家，靠的不仅仅是你必须耐受得了无边的寂寞，承受得了漫漫的孤独，除了你必须具备一如既往的坚韧不拔的毅力，炼就一双博采众长洞察秋毫的慧眼，站在社会发展的前列及时并准确的把握世间百态的脉搏。也许，你付出了一辈子的心血和努力，到最后换来的依然是一文不名，两手空空的结果，而凭借东拼西凑式的抄袭终将会显露出你真正的庐山面目，为众人所唾弃，实在是得不偿失得很。<br />\n&emsp;&emsp;<br />\n&emsp;&emsp;诚然，摆在无畏困苦的写作者面前的路是极为艰难的，过去如此，往后也是如此。披荆斩棘，那是他们的真诚，扪心无愧，那是他们秉持一份清宁的初心，为对他人、对自己的人生给出一份良好的交代，借这一方无声的世界去表达他们内心真切的声音，去记录人生中走过的每一段路，而不是习自作聪明者之作为在圣洁的文学之路上肆意践踏，疯狂作乱。<br />\n<br />'),
(134, '&emsp;生活可以复杂，也可以简单，看我们拥有怎样的心态。简单就真实，平淡就从容。没有虚伪，不戴面具；不去张扬，甘愿淡泊。荣也好，辱也罢，一切好的不好的，不过是岁月变迁的填充物，到最后，都是过去。<br />\n&emsp;&emsp;<br />\n&emsp;&emsp;相信人生没有毫无意义的经历。上天给我们困难，是让我们看透人心；给我们失败，是教会我们如何更好地成功；给我们孤独，是让我们学会慎独和反省。此处失，他处得，有人让你哭了，就会有人让你笑，这是上天对待每一个人的公平。<br />\n&emsp;&emsp;<br />\n&emsp;&emsp;人生路上不是每轮艳阳都暖人，不是每片云彩都下雨。一些事，想开自然微笑，看透肯定放下。人在旅途，心宽，才是海阔天空。<br />\n&emsp;&emsp;<br />\n&emsp;&emsp;心怀善念，能利人；心怀感恩，能利己。学会换位，人生才有和谐；知道感恩，岁月才有温暖。活着，就是一场修行，而真正的修行，不在一张能言的嘴上，而在一颗向善的心里。人生之光，是一颗宽容的心；岁月之好，是一份随缘的爱。<br />\n&emsp;&emsp;<br />\n&emsp;&emsp;世界上最美丽的风景，就是你有一颗善良的心，散发着优美的磁场和魅力，走到哪里，就照亮到哪里，温暖到哪里。<br />\n&emsp;&emsp;<br />\n&emsp;&emsp;人生，总有许多沟坎需要跨越；岁月，总有许多遗憾需要弥补；生命，总有许多迷茫需要领悟。美好是属于自信者的，机会是属于开拓者的，奇迹是属于执着者的！你若不想做，总会找到借口；你若想做，总会找到方法。坚持未必是胜利，放弃未必是认输，与其华丽撞墙，不如优雅转身，给自己一个迂回的空间。学会思索，学会等待，学会调整。很多时候，比起执着，我们更需要的是回眸一笑的洒脱。<br />\n&emsp;&emsp;<br />\n&emsp;&emsp;一直觉得，人生就像是培育种子。你投入的每一分努力，都会在未来的某一天，回馈于你。而你所要做的，就是每天多努力一点点。在这路上，别人拥有的，不必羡慕；自己没有的，不要嫉妒。相信，只要努力，时间都会给你。<br />\n&emsp;&emsp;<br />\n&emsp;&emsp;没有播种，哪来收获；没有辛劳，哪来成功；生活本来平淡如水，放一点盐它就是咸的，放一点糖它就是甜的，想调成什么味道，全凭自己！<br />\n&emsp;&emsp;<br />\n&emsp;&emsp;成功没有快车道，幸福没有高速路，一份耕耘一份收获，所有的成功都来自不倦的努力和奔跑，所有幸福都来自平凡的奋斗和坚持。<br />\n&emsp;&emsp;<br />\n&emsp;&emsp;坚持，不是为了感动谁，也不是证明给谁看。而是，一路奔跑，总比原地踏步好！坚持，不是心动，而是一种行动，就是简单的事情重复做，重复的事情认真做，认真的事情努力做。一点一滴的积累，你就会发现，原来成功的路上并不拥挤，因为坚持的人并不多。<br />\n&emsp;&emsp;<br />\n&emsp;&emsp;生活就像浮在水上的鸭子，表面上从容淡定，其实水底下在拼命的划水。想要过好的生活，就要拼命努力。优雅需要底气，华丽需要实力。<br />\n&emsp;&emsp;<br />\n&emsp;&emsp;人这辈子，总有人羡慕你，也有人讨厌你；总有人嫉妒你，还有人看不起你。没关系，生活就是这样。你所做的一切并不能让每个人都满意，不必为了讨好别人而丢失自己的本性。一样的眼睛，不一样的看法；一样的耳朵，不一样的听法；一样的嘴巴，不一样的说法；一样的心，不一样的想法；一样的钱，不一样的花法；一样的人们，不一样的活法。别人嘴里的你，不是真实你的你。你无需告诉每个人，那一个个艰难的日子是如何熬过来的，大多数人都看你飞得高不高，很少人在意你飞得累不累。<br />\n&emsp;&emsp;<br />\n&emsp;&emsp;决心走一条路的时候，就不要左顾右盼，风景再美也别流连。起风的日子学会依风起舞，落雨的时候学会为自己撑一把伞。幸福就是，即使累了，还能笑着活出自我，努力奔跑。任岁月变迁，我心不惊，凭时光流转，我心如初。<br />\n&emsp;&emsp;<br />'),
(137, '有人说，人生，是一场修行，也有人说，人生，是一段旅程。而我却觉得，人生，是一场追求，也是一场领悟。<br />\n&emsp;&emsp;<br />\n&emsp;&emsp;平淡的日子里，安静，简单，没有起伏，没有波澜。有的只是一种安宁，一种重复，一种寂静。无论时光如何流逝，无论季节怎样变化，一如平常，安然于自己的生活，忙碌于自己的工作，坚持于自己喜欢做的事情，无论从何时起步，都不算晚。<br />\n&emsp;&emsp;<br />\n&emsp;&emsp;梦想就像天上星星，也许你永远无法触碰，但如果你跟随它们，它们将引领你找到最正确的方向。对信任你的人，永远别撒谎。对你撒谎的人，永远别太相信。有时候，失望到一定程度后，反而会开出一朵花来，那朵花的名字叫，无所谓。<br />\n&emsp;&emsp;<br />\n&emsp;&emsp;人生最美好的，就是在你停止生存时，还能够以你所创造的一切为人们服务。你在等待，你在坚忍，你在静默。你在等一场春华秋实，你在等新一轮的春暖花开，你在等从未有过的雷霆万钧。这静默的日子有些长，有些闷，但是我也会等下去。我相信人的青春不止有一次，有时候，时光会给你额外的惊喜。<br />\n&emsp;&emsp;<br />\n&emsp;&emsp;一直认为，这世上最公平的，就是时间。别人偷不走，你也留不住。你拥有它，却又无法改变它。一路走来，你留在光阴里的艰难抑或快乐，都会随着时光的流逝被一一带走，身处其中的你我，无论是年轻还是衰老，所能做的，都只有充分的利用和享用它。<br />\n&emsp;&emsp;<br />\n&emsp;&emsp;想要过好每一天，不如先让今天充实。毕竟，那看似漫长的岁月，都是由无数个“今天”堆砌而成。岁月是种轮回，人生是种历练。我一直这样的提醒自己，让自己明白生活不需要太多的刻意。很多时候，我们都在不知不觉刻意人生，勉强生活，为的就是满足一份来自内心深处的虚荣。走在自己的路上，眼里却是别人路上的风景。直至有一天，后来者怀抱五彩鲜花，经过自己身旁时，羡慕之余才发现，一路匆忙，只顾观望他山之巅，却忽略了自己路上的满地鲜花。<br />\n&emsp;&emsp;<br />\n&emsp;&emsp;也许，此刻的你，正经历着某种辛酸，一路风雨兼程的赶来，却尽在一片黑暗中摸索，等待着云开见月明。然，只要你心中有信念，就要相信，寒夜终有时，太阳总有升。伤心失望的日子，你可能暂时无力改变现状，但你却可以选择自己的态度。或是悲观消极，或是笑容浅露。同一条路上的行人，有人哭泣也有人欢笑，最后都将抵达不一样的彼岸，就看你选择的是哪一种。<br />\n&emsp;&emsp;<br />\n&emsp;&emsp;每个人都是独立的个体，期待走不一样的人生路，收获不一样的生命色彩。倘若人生可以重来一次，亦不过是多了一场山长水阔，沿途的风景，依旧有枯荣；一路的悲喜，依旧似风雨。无论你选择的是哪一条路，阴晴圆缺，苦乐交融，都是必不可少的烟火。有些路，你若不坚持走下去，你就永远不知道它到底有多美。<br />\n&emsp;&emsp;<br />\n&emsp;&emsp;天空不总是晴朗，阳光不总是闪耀，人生，无所谓失去，只怕草率地挥霍。世界上，唯独骗不了的，就是自己的心。它总在你最没提防时，暴露你的欢喜忧愁。对太多的事情，寄予美好的期待，却是一再不尽人意。那些无心插柳随意而为的事情，反而更容易带给人意想不到的惊喜。人生犹如变化着的四季，途径每一季，都会有着不同的色彩。来去匆匆，变化无常。我们在创造自己的人生的同时，也该充分享受这人生。<br />\n&emsp;&emsp;<br />\n&emsp;&emsp;美好的，留在心底；遗憾的，随风散去。尽管，还有那么多梦想无法实现；尽管，还有那么多沮丧埋在心田。但那又如何？我在冰峰的深海，寻找希望的缺口，却在惊醒时，瞥见绝美的阳光。<br />\n&emsp;&emsp;<br />\n&emsp;&emsp;或许，人生更像是一场电影，痛苦是一个开端，挣扎是一种过程，死亡是一种结局。纵然难免留有遗憾，我也相信，终究还是会有一个完美的角落。不要着急，相信最好的，总会在你不经意的时候出现。活在当下，时光且长，一切都来得及。<br />'),
(138, '生命，就像是一张借记卡，从你呱呱坠地，还未有名字的时候，你生命的借记卡就已经毫不延迟的启动了它的业务。<br />\n&emsp;&emsp;<br />\n&emsp;&emsp;储存在生命借记卡上的数字，就是你这一生所有的时光。你此后生活的每一天，都是对这张借记卡的消费。虽然，你是它的主人，但你却不知道它的多少。幸好不知道，我们才会一边消费着卡额，一边无忧无虑的生活。懵然向前中，支出着我们生命有限的时间，于万千世相的一片混沌中，等待着这张卡的归零。<br />\n&emsp;&emsp;<br />\n&emsp;&emsp;常常，有很多事情不能如愿以偿，我们会安抚自己来日方长，以后有的是时间。于是，接下来的日子里，就开始了碧落黄泉，不及不归的执着。人在很多时候，都是盲目的。越是不可及，越是仰望；越是得不到，越是心念。却不知道天地苍茫，处处都可以花香满径，何必一条路走到黑。难道，你不相信自己，值得走过更美丽的山水，收获不一样的风景吗？<br />\n&emsp;&emsp;<br />\n&emsp;&emsp;生命就是一张纵横交错的网，当你行至穷途末路的时候，切莫忘了转身回望。人生不仅需要一往无前，有时候，来个急刹车，急转弯，未必不是更好的选择。把那些求不得，又舍不下的优柔寡断，转换成不颓败，不纠结的乐观情绪，换条路走，说不定天宽地广。不忘初心，方得始终；不殆时间，不负自己。<br />\n&emsp;&emsp;<br />\n&emsp;&emsp;阡陌红尘，我们形同尘埃般的行走，总有些人留住我们回眸的眼神，羁绊着我们前进的脚步。于是，我们也曾驻足，也曾动情，却不想生命有很多相逢，不过形同一阵风。你感受得到它的擦身而过，却终是留不住它随性的身影。纵然在你耳边轻吟浅唱，亦不过是一场美丽的缘错。<br />\n&emsp;&emsp;<br />\n&emsp;&emsp;这世上就是有这样一种人，你不把他当回事，他把你当回事儿；你投桃报李把他当回事儿，他又觉得你好像很上赶似的。总有那么一些人，配不起真诚。<br />\n&emsp;&emsp;<br />\n&emsp;&emsp;向来，真诚，才是静水流深，是搭建人与人长情的桥梁。否则，谁都没必要拿一份热情典当成廉价的守候。不要把别人的谦和友善误解成你的高高在上，那不过是别人的涵养素质。毕竟，在这世上，谁都不是谁的谁，若有，锦上添花；若无；亦自在潇洒。你若懂我，携手一程；若是不懂，各自前行。<br />\n&emsp;&emsp;<br />\n&emsp;&emsp;人这一生，有限的生命，却要划分为无数个阶段去消费。不论你行经生命的哪一站，都要为值得停留的风景而驻足。你的消费，总要换来你该有的东西，而不是白白虚度。拿得起，放得下，干脆利索，做出果断的选择，毅然走入下一段行程。<br />\n&emsp;&emsp;<br />\n&emsp;&emsp;很多时候，你觉得，破釜沉舟，重长计议是艰难的，是前功尽弃的，却不想，当你纠结于一件牵强附会的事情，久久踌躇，牵绊左右的时候，亦是一种破费。因为，你付出了时间，透支了你的借记卡。而你透支的这部分，本身它就是一种无偿的损失。<br />\n&emsp;&emsp;<br />\n&emsp;&emsp;不要浪费感情在不值得的人身上，也不要花费时间在没意义的事情上。很多时候，你认为的固守，只不过是自己的掩耳盗铃。你廉价的消费着自己最宝贵的东西，却不知道它原本值得与岁月来一场更有价值的交换。<br />\n&emsp;&emsp;<br />\n&emsp;&emsp;时间会告诉你，万物之始，大道至简，衍化至繁。<br />\n&emsp;&emsp;<br />\n&emsp;&emsp;唯有理性消费，有舍有得，生命才会更加的充实有效。直到有一天，那张手中的借记卡即将被清零的时候，我们回首，查询这一路走来的每一笔消费，都能够欣然一笑。觉得曾经有过的每一笔支出都是值得的，扪心无悔，不觉有憾，这一生，也就算得上圆满了。<br />'),
(139, '&emsp;&emsp;一程光阴，一程山水，平凡的日子，一手握着珍惜，一手握着行走；素简流年，那些光阴抹不掉的印痕依稀牵动心潮，是久久的萦绕。满怀的心语化作欲言又止，岁月的云烟悄悄潜入记忆……最美的时光总是守住一窗安静，让文字生香。摘一缕清风明月，种一阕阳春白雪，让心灵的田园满是通透与清欢……<br />\n<pre class=\"prettyprint lang-php\">$psql = \" select  `user_openid`, `mobile`, `isnew`, `userid`, `realname`, `parentid`,`parentname`, `departid`, `departname`,addtime,prize,money from `zh1127_lottory` where 1=1 \" . $sqlstr . \" order by id asc limit \".$start.\",\".$perSize.\" \";\n    $pres = $rnpdo-&gt;RnFetchAll($psql, array());</pre>\n<br />\n&emsp;&emsp;人生是一场漫长的旅行，生活的故事不会永远的平静如水阳光明媚，将自信、善良、坚定、无悔融于生命之中，走成属于自己的风景。总感觉自己走过了一条很简单很长远的路程。期间那一段心灵的荒芜常常想起，一个人的日子，一次次问自己，如果可以，我能否在从前里寻找现在的自己？拄笔前行，是我心灵的皈依。<br />\n<br />\n&emsp;&emsp;这时节，淡雅的花朵开满每一个角角落落，轻嗅风中吹过的香气丝丝缕缕，思念如扯不断理还乱的雨。许多无奈、心酸、感叹在日复一日，年复一年里写进了人生旅途。思绪，心音，梦痕，心中的飘渺虚幻生长蔓延。落地的情缘再次缱绻，仿佛一份眷恋可以万水千山，千年万年……<br />\n<br />\n&emsp;&emsp;或许，生命中每一种相逢前世早已注定。花开有声，心中酝酿的诗行只为那一片相遇的深情。心事如莲，呢喃成相思的花语，落笔生香，相伴孤灯下的守望。眺守你你所在的方向，思念无法在某个角落深藏，漫过文字的河床，浸润柔美的心房。星光如水，新月如眉。那一窗如诗的清韵婉约成一脉柔美深情。缕缕痴缠穿越绿水青山，荡在眉端心田，眷恋柔软，仿佛已过千年。语丝绵绵，细细聆听，思念对一个名字轻轻呢喃……<br />\n<br />\n&emsp;&emsp;总是在无奈的日子里回望那些漫长，那些忧伤，时光苍茫，晕染了风霜。心的安静淹没于纷纷扰扰之中，流浪飘零。总感觉生命里的美好只是昙花一现，流星一闪，无法抵达的永远到底有多远？<br />\n<br />\n&emsp;&emsp;也许相携一份淡然知足，每一个日子都能幸福安暖，风来不惊，雨落无声，如此平平静静。看着夕阳再次吻别青山，晚霞的余辉中又种一个新的期盼。一朵香莲在心中缓缓舒展……曾经禹禹独行的路上绿荫清凉，心入清香。将一份最美的期盼端放在前方，遥看水天一色，品读平静淡然，温柔安暖。携几行小字，轻嗅最美诗意；赏一片流云舒卷，掬一朵雅致清莲，心中绽放清爽与芬芳。（文章阅读网：www。sanwen。net）<br />\n<br />\n&emsp;&emsp;将一些心语寄予文字，将走远的故事点滴倾诉。只是，思念一如往昔，跌落在水中，泛起一圈圈涟漪……清风能读懂，流云听得见。温润的软风，安宁淡雅，在柔雨初停的午后飘进来，隔了淡绿的纱窗，落在我的电脑旁。躲过恼人的喧哗，我在清茗半盏中寻找时间的缝隙，停泊在心灵的港湾里。读你，文字中的美丽；赏你，是花事般的相遇。情亦深深，念亦温婉，一遇，便成永远。不能没有你，这是我不变的情怀，真情留下来。将一朵清欢深种，于一片心相约的芳草地……踏着月光去寻觅，满地清愁，我一一捡拾。总有一些来得及以及一些来不及走进了生命里，今生来生选择与释然相伴相依。<br />\n<br />\n&emsp;&emsp;光阴轻浅，真实绣织，日子里散落了事与愿违的前尘，霏霏如雨。生活之中，总要相遇一些东西薄如蝉翼。玫瑰落雨，昔日已梦……凝眸，惟愿心灵深处的散发，可以留香。阡陌之中，以它温暖那颗潮湿的心……<br />\n<br />\n&emsp;&emsp;封锁的记忆慢慢开启，昨日的云烟随风散去。思念如一棵开花的树，在这个季节的垄中旖旎茂密。若有灵犀，你可否留意，每天晨晖中的晃动，那不是风，而是我深情的叮咛。浓浓淡淡的心绪温婉在岁月里，日子，疏落成一笔明月清风，月缺是诗，月圆是歌。尘世、繁华、云烟淡远，我心中所有的语言交给了无言。流年，在文字中婉转，悠扬；人生，每一份经历，在时光中生香。还好，我不在乎忧伤，只眺望经年的芬芳。如此，季节开始晕染舒适、清爽……时光里的故事盘旋在心间，是一朵温暖的记忆。<br />\n<br />\n&emsp;&emsp;好想种一棵深情树，每一片绿油油的叶子都是我写给岁月的情书。任凭花开，任凭雨落，任凭风起，任凭云涌，我都以一种颜色诉说。静握着素淡的日子，将所有的情思放逐。拥一怀简约，掬一捧花香，听月光流淌，在文字中徜徉，一份柔软将整个生命贯穿，安静安暖……<br />\n<br />\n&emsp;&emsp;好想说，感谢相遇，感谢从墨香中走来的你，文字中读你，我漂泊的心灵从此有了皈依；心灵的共鸣，让我忘记孤单，天涯化作咫尺。生命里有种相伴，便是灵魂相惜。如此，且将这份美好交给我的流年，我的岁月……<br />\n<br />'),
