o many frustrations buried in the heart. But what about that? I am in the deep sea ice, hope to find the gap, but in the wake of, catch a glimpse of beautiful sunshine.<br />\n<br />\nPerhaps, life is more like a movie, the pain is a beginning, is a process of struggle, death is an ending. Even if there are some regrets, I believe that there will still be a perfect corner. Don\'t try so hard, the best things come when you least expect them to. Live in the present, time and long, and everything is in time.<br />'),
